INSERT INTO `movies` VALUES (5818,'Titanic',1998,NULL,194,4.0,NULL,5.0,NULL,'Southampton, 10 avril 1912. Le paquebot le plus grand et le plus moderne du monde, réputé pour son insubmersibilité, le \"Titanic\", appareille pour son premier voyage. Quatre jours plus tard, il heurte un iceberg. A son bord, un artiste pauvre et une grande bourgeoise tombent amoureux.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/01/10/16/06/0622119.jpg',NULL,NULL,NULL),(18478,'Mary à tout prix',1998,NULL,119,4.0,NULL,4.0,NULL,'Ted, le ','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/14/14/11/3909229.jpg',NULL,NULL,NULL),(27415,'Shrek',2001,NULL,89,4.0,NULL,4.0,NULL,'Shrek, un ogre verdâtre, cynique et malicieux, a élu domicile dans un marécage qu\'il croit être un havre de paix. Un matin, alors qu\'il sort faire sa toilette, il découvre de petites créatures agaçantes qui errent dans son marais.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/00/00/00/66/69199338_af.jpg',NULL,NULL,NULL),(28537,'Astérix et Obélix : Mission Cléopâtre',2002,NULL,112,4.0,NULL,4.0,NULL,'Cléopâtre, la reine d’Égypte, décide, pour défier l\'Empereur romain Jules César, de construire en trois mois un palais somptueux en plein désert. Si elle y parvient, celui-ci devra concéder publiquement que le peuple égyptien est le plus grand de tous les peuples. Pour ce faire, Cléopâtre fait appel à Numérobis, un architecte d\'avant-garde plein d\'énergie. S\'il réussit, elle le couvrira d\'or. S\'il échoue, elle le jettera aux crocodiles.','https://fr.web.img3.acsta.net/c_310_420/pictures/23/06/21/12/06/4953335.jpg',NULL,NULL,NULL),(28538,'Master & Commander : de l\'autre côté du monde',2003,NULL,138,4.0,NULL,4.0,NULL,'En 1805, le capitaine Jack Aubrey est une des figures les plus brillantes de la Marine Royale britannique. Son courage, sa ténacité, son sens tactique lui ont valu le respect et l\'admiration des officiers et matelots du vaisseau de guerre Surprise.','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/35/15/63/18364956.jpg',NULL,NULL,NULL),(29232,'Training Day',2001,NULL,121,4.0,NULL,3.0,NULL,'Jake Hoyt est une nouvelle recrue de la police de Los Angeles. Décidé à devenir inspecteur, il sollicite une mise à l\'essai de 24 heures auprès du sergent-chef Alonzo Harris, un vétéran de la lutte antidrogue qui opère depuis douze ans dans les quartiers les plus chauds de la ville.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/68/61/99/19425646.jpg',NULL,NULL,NULL),(29276,'Harry Potter à l\'école des sorciers',2001,NULL,152,4.0,NULL,4.0,NULL,'Orphelin, Harry Potter a été recueilli à contrecœur par son oncle Vernon et sa tante Pétunia, aussi cruels que mesquins, qui n\'hésitent pas à le faire dormir dans le placard sous l\'escalier. Constamment maltraité, il doit en outre supporter les jérémiades de son cousin Dudley, garçon cupide et archi-gâté par ses parents. De leur côté, Vernon et Pétunia détestent leur neveu dont la présence leur rappelle sans cesse le tempérament \"imprévisible\" des parents du garçon et leur mort mystérieuse.','https://fr.web.img6.acsta.net/c_310_420/pictures/18/07/02/17/25/3643090.jpg',NULL,NULL,NULL),(35370,'C\'est La Vie',2001,NULL,113,4.0,NULL,3.0,NULL,'Dimitri, 49 ans, est un homme très malade. Il rejoint \"La Maison\", un lieu où sont accueillies des personnes pour qui la médecine ne peut plus rien. Il y fait la rencontre de Suzanne, une bénévole qui se consacre à l\'accompagnement des gens en fin de vie.','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/00/02/31/70/affvie.jpg',NULL,NULL,NULL),(39187,'Le Seigneur des anneaux : le retour du roi',2003,NULL,201,4.0,NULL,4.0,NULL,'Les armées de Sauron ont attaqué Minas Tirith, la capitale de Gondor. Jamais ce royaume autrefois puissant n\'a eu autant besoin de son roi. Mais Aragorn trouvera-t-il en lui la volonté d\'accomplir sa destinée ?','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/35/14/33/18366630.jpg',NULL,NULL,NULL),(41011,'8 Mile',2003,NULL,110,4.0,NULL,4.0,NULL,'A Detroit, en 1995, Jimmy Smith Jr. a des rêves plein la tête, mais il lui manque encore les mots pour les exprimer. Sa vie d\'adolescent se déroule entre banlieue blanche et quartiers noirs, le long de cette ligne de démarcation que l\'on nomme ','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/00/02/46/93/affiche.jpg',NULL,NULL,NULL),(44792,'Pierre Lapin',2018,NULL,90,4.0,NULL,4.0,NULL,'Le petit lapin préféré des jeunes lecteurs depuis des générations est désormais le héros d’un film plein d’aventures et d’espièglerie ! L\'éternelle lutte de Pierre Lapin avec M. McGregor pour les légumes du potager va atteindre des sommets. Sans parler de leur rivalité pour plaire à cette charmante voisine qui adore les animaux… Bien au-delà du jardin, de nombreuses péripéties les entraîneront de la magnifique région des lacs en Angleterre jusqu’à Londres !','https://fr.web.img5.acsta.net/c_310_420/pictures/18/04/05/15/25/1052693.jpg',NULL,NULL,NULL),(45644,'Out of Time',2004,NULL,105,3.0,NULL,3.0,NULL,'Matt Lee Whitlock est le chef de la police de Banyan Key en Floride. Respecté par ses pairs et apprécié par les habitants, il dirige une équipe de quatre policiers incluant sa femme, l\'inspecteur Alex Diaz, dont il est sur le point de divorcer. Whitlock a renoué avec sa petite amie, Ann, mariée à un footballeur déchu au tempérament violent, Chris. Un jour, celle-ci lui déclare qu\'elle souffre d\'un cancer. Son seul espoir : se rendre en Europe pour y suivre un traitement expérimental, mais elle est à court d\'argent.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/35/17/93/18369270.jpg',NULL,NULL,NULL),(45854,'L\'Amour sans préavis',2003,NULL,101,2.0,NULL,3.0,NULL,'Le millionnaire Georges Wade ne prend aucune décision sans consulter Lucy Kelson, sa conseillère multi-fonction en chef à la Wade Corporation. Brillante avocate et fin stratège, elle a aussi un ulcère et ne dort pas beaucoup. Ce n\'est pas son travail qui en est la cause mais George. Intelligent, charmeur et totalement centré sur lui-même, il la traite plus comme sa nourrice que comme une avocate sortant de Harvard. Aujourd\'hui, après avoir tout régi pendant cinq ans, de ses vêtements à son divorce, Lucy Kelson a décidé de démissionner.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/00/02/57/88/aff.jpg',NULL,NULL,NULL),(47326,'La Passion du Christ',2004,NULL,127,3.0,NULL,2.0,NULL,'Les douze dernières heures de la vie du Christ. Rendu au Mont des Oliviers, Jésus prie après avoir partagé un dernier repas avec ses apôtres. Il résiste maintenant aux tentations de Satan. Trahi par Judas, Jésus est arrêté et emmené à Jérusalem, où les chefs des Pharisiens l\'accusent de blasphème et lui font un procès qui a pour issue sa condamnation à mort...','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/35/22/44/18375186.jpg',NULL,NULL,NULL),(47357,'Troie',2004,NULL,155,4.0,NULL,3.0,NULL,'Dans la Grèce antique, l\'enlèvement d\'Hélène, reine de Sparte, par Paris, prince de Troie, est une insulte que le roi Ménélas ne peut supporter. L\'honneur familial étant en jeu, Agamemnon, frère de Ménélas et puissant roi de Mycènes, réunit toutes les armées grecques afin de faire sortir Hélène de Troie.','https://fr.web.img3.acsta.net/c_310_420/medias/nmedia/18/35/23/55/18379045.jpg',NULL,NULL,NULL),(50325,'Les Choristes',2004,NULL,97,4.0,NULL,4.0,NULL,'En 1948, Clément Mathieu, professeur de musique sans emploi accepte un poste de surveillant dans un internat de rééducation pour mineurs ; le système répressif appliqué par le directeur, Rachin, bouleverse Mathieu. En initiant ces enfants difficiles à la musique et au chant choral, Mathieu parviendra à transformer leur quotidien.','https://fr.web.img6.acsta.net/c_310_420/pictures/24/03/20/17/00/0381736.jpg',NULL,NULL,NULL),(52912,'Le Village',2004,NULL,108,3.0,NULL,4.0,NULL,'Une petite communauté isolée vit dans la terrifiante certitude qu\'une race de créatures mythiques peuple les bois entourant le village. Cette force maléfique est si menaçante que personne n\'ose s\'aventurer au-delà des dernières maisons, et encore moins pénétrer dans les bois... Le jeune Lucius Hunt, un garçon entêté, est cependant bien décidé à aller voir ce qui se cache par-delà des limites du village, et son audace menace de changer à jamais l\'avenir de tous...','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/35/30/82/18384725.jpg',NULL,NULL,NULL),(53756,'Harry Potter et la Coupe de Feu',2005,NULL,157,4.0,NULL,4.0,NULL,'La quatrième année à l\'école de Poudlard est marquée par le \"Tournoi des trois sorciers\". Les participants sont choisis par la fameuse \"coupe de feu\" qui est à l\'origine d\'un scandale. Elle sélectionne Harry Potter alors qu\'il n\'a pas l\'âge légal requis !','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/35/52/34/18450888.jpg',NULL,NULL,NULL),(54098,'À la recherche du bonheur',2007,NULL,118,4.0,NULL,3.0,NULL,'Représentant de commerce, Chris Gardner a du mal à gagner sa vie. Il jongle pour s\'en sortir, mais sa compagne supporte de moins en moins leur précarité. Elle finit par quitter Chris et leur petit garçon de cinq ans, Christopher.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/62/89/48/18708437.jpg',NULL,NULL,NULL),(56714,'Million Dollar Baby',2005,NULL,132,4.0,NULL,5.0,NULL,'Rejeté depuis longtemps par sa fille, l\'entraîneur Frankie Dunn s\'est replié sur lui-même et vit dans un désert affectif, en évitant toute relation qui pourrait accroître sa douleur et sa culpabilité.','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/35/48/67/18409541.jpg',NULL,NULL,NULL),(57060,'L\'Etrange histoire de Benjamin Button',2009,NULL,155,4.0,NULL,4.0,NULL,'\"Curieux destin que le mien...\" Ainsi commence l\'étrange histoire de Benjamin Button, cet homme qui naquit à 80 ans et vécut sa vie à l\'envers, sans pouvoir arrêter le cours du temps. Situé à La Nouvelle-Orléans et adapté d\'une nouvelle de F. Scott Fitzgerald, le film suit ses tribulations de 1918 à nos jours. L\'étrange histoire de Benjamin Button : l\'histoire d\'un homme hors du commun. Ses rencontres et ses découvertes, ses amours, ses joies et ses drames. Et ce qui survivra toujours à l\'emprise du temps...','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/67/78/06/19028560.jpg',NULL,NULL,NULL),(57529,'300',2007,NULL,115,4.0,NULL,3.0,NULL,'Adapté du roman graphique de Frank Miller, ','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/36/26/41/18737112.jpg',NULL,NULL,NULL),(57881,'Red Eye / sous haute pression',2005,NULL,90,2.0,NULL,3.0,NULL,'Lisa Reisert a une peur bleue de l\'avion, mais l\'horreur qui l\'attend sur ce vol de nuit pour Miami n\'a rien à voir avec sa phobie.','https://fr.web.img4.acsta.net/c_310_420/medias/nmedia/18/35/85/91/18443181.jpg',NULL,NULL,NULL),(59827,'Prédictions',2009,NULL,121,3.0,NULL,3.0,NULL,'Pour fêter l\'anniversaire d\'une école, une cérémonie est organisée au cours de laquelle une capsule temporelle contenant des messages écrits par des enfants 50 ans auparavant est déterrée et ouverte. Chaque enfant emporte chez lui un message, mais celui du petit Caleb est illisible, car il s\'agit d\'une suite incohérente de chiffres.','https://fr.web.img4.acsta.net/c_310_420/medias/nmedia/18/68/32/64/19055024.jpg',NULL,NULL,NULL),(59948,'Et si c\'était vrai...',2005,NULL,95,3.0,NULL,2.0,NULL,'Alors que David s\'installe dans l\'appartement qu\'il vient de louer, une jeune femme, Elizabeth, apparaît soudainement, affirmant que cet appartement est le sien. David pense d\'abord avoir affaire à un malentendu... jusqu\'à ce qu\'Elizabeth disparaisse aussi mystérieusement qu\'elle était apparue.','https://fr.web.img5.acsta.net/c_310_420/medias/nmedia/18/35/92/43/18451650.jpg',NULL,NULL,NULL),(60426,'The Holiday',2006,NULL,131,4.0,NULL,2.0,NULL,'Une Américaine (Amanda) et une Anglaise (Iris), toutes deux déçues des hommes, décident, sans se connaître, d\'échanger leurs appartements. Iris, va débarquer dans une demeure de rêve tandis que la distinguée Amanda découvre une petite maison de campagne sans prétentions. Les deux femmes pensent passer de paisibles vacances loin de la gent masculine, mais c\'était sans compter l\'arrivée du frère d\'Iris dans la vie d\'Amanda, et la rencontre de Miles pour Iris.','https://fr.web.img4.acsta.net/c_310_420/medias/nmedia/18/62/83/50/18689023.jpg',NULL,NULL,NULL),(109788,'There Will Be Blood',2008,NULL,158,4.0,NULL,5.0,NULL,'Lorsque Daniel Plainview entend parler d\'une petite ville de Californie où l\'on dit qu\'un océan de pétrole coulerait littéralement du sol, il décide d\'aller tenter sa chance et part avec son fils H.W. à Little Boston. Dans cet endroit perdu où chacun lutte pour survivre et où l\'unique distraction est l\'église animée par le charismatique prêtre Eli Sunday, Plainview et son fils voient le sort leur sourire.','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/63/80/44/18887932.jpg',NULL,NULL,NULL),(110268,'Un prophète',2009,NULL,155,4.0,NULL,5.0,NULL,'Condamné à six ans de prison, Malik El Djebena ne sait ni lire, ni écrire. A son arrivée en Centrale, seul au monde, il paraît plus jeune, plus fragile que les autres détenus. Il a 19 ans.','https://fr.web.img5.acsta.net/c_310_420/medias/nmedia/18/70/33/24/19138702.jpg',NULL,NULL,NULL),(111643,'La Vie des autres',2007,NULL,137,4.0,NULL,4.0,NULL,'Au début des années 1980, en Allemagne de l\'Est, l\'auteur à succès Georg Dreyman et sa compagne, l\'actrice Christa-Maria Sieland, sont considérés comme faisant partie de l\'élite des intellectuels de l\'Etat communiste, même si, secrètement, ils n\'adhèrent aux idées du parti.','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/63/15/65/18708573.jpg',NULL,NULL,NULL),(125054,'Mad Max: Fury Road',2015,NULL,120,4.0,NULL,4.0,NULL,'Hanté par un lourd passé, Mad Max estime que le meilleur moyen de survivre est de rester seul. Cependant, il se retrouve embarqué par une bande qui parcourt la Désolation à bord d\'un véhicule militaire piloté par l\'Imperator Furiosa. Ils fuient la Citadelle où sévit le terrible Immortan Joe qui s\'est fait voler un objet irremplaçable. Enragé, ce Seigneur de guerre envoie ses hommes pour traquer les rebelles impitoyablement…','https://fr.web.img6.acsta.net/c_310_420/pictures/15/04/14/18/30/215297.jpg',NULL,NULL,NULL),(127486,'Les Noces rebelles',2009,NULL,125,4.0,NULL,4.0,NULL,'Dans l\'Amérique des années 50, Frank et April Wheeler se considèrent comme des êtres à part, des gens spéciaux, différents des autres. Ils ont toujours voulu fonder leur existence sur des idéaux élevés. Lorsqu\'ils emménagent dans leur nouvelle maison sur Revolutionary Road, ils proclament fièrement leur indépendance. Jamais ils ne se conformeront à l\'inertie banlieusarde qui les entoure, jamais ils ne se feront piéger par les conventions sociales.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/65/75/28/19027674.jpg',NULL,NULL,NULL),(128851,'Jackpot',2008,NULL,100,3.0,NULL,2.0,NULL,'Joy vient de se faire larguer. Jack vient de se faire virer. Ils ne se connaissent pas mais, après une nuit de folie à Las Vegas, la ville de tous les possibles... ils se réveillent... mariés. Ils sont d\'accord pour se séparer à l\'amiable... mais tout change quand Jack gagne 3 millions de dollars aux machines à sous avec une pièce prêtée par Joy. Pour garder le jackpot, chacun va alors tenter de se rendre insupportable pour dégouter l\'autre et le pousser au divorce.','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/65/68/95/18930690.jpg',NULL,NULL,NULL),(132039,'Shutter Island',2010,NULL,137,4.0,NULL,4.0,NULL,'En 1954, le marshal Teddy Daniels et son coéquipier Chuck Aule sont envoyés enquêter sur l\'île de Shutter Island, dans un hôpital psychiatrique où sont internés de dangereux criminels. L\'une des patientes, Rachel Solando, a inexplicablement disparu. Comment la meurtrière a-t-elle pu sortir d\'une cellule fermée de l\'extérieur ? Le seul indice retrouvé dans la pièce est une feuille de papier sur laquelle on peut lire une suite de chiffres et de lettres sans signification apparente. Oeuvre cohérente d\'une malade, ou cryptogramme ?','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/69/96/84/19151192.jpg',NULL,NULL,NULL),(134390,'La Vague',2009,NULL,107,4.0,NULL,3.0,NULL,'En Allemagne, aujourd\'hui. Dans le cadre d\'un atelier, un professeur de lycée propose à ses élèves une expérience visant à leur expliquer le fonctionnement d\'un régime totalitaire. Commence alors un jeu de rôle grandeur nature, dont les conséquences vont s\'avérer tragiques.','https://fr.web.img5.acsta.net/c_310_420/medias/nmedia/18/66/85/86/19047152.jpg',NULL,NULL,NULL),(134690,'Que justice soit faite',2010,NULL,109,4.0,NULL,2.0,NULL,'Dix ans après le meurtre de sa femme et sa fille, un homme se dresse contre le procureur en charge du procès des meurtriers, pour obtenir lui-même la justice. Sa vengeance menace tout aussi bien l\'homme qui leur a accordé la clémence, que le système et la ville elle-même.','https://fr.web.img5.acsta.net/c_310_420/medias/nmedia/18/72/55/36/19593496.jpg',NULL,NULL,NULL),(135257,'Evasion',2013,NULL,116,3.0,NULL,2.0,NULL,'Ray Breslin est un ingénieur spécialisé dans la conception de prisons ultrasécurisées. Il teste lui-même l’efficacité de ses bâtiments en se faisant enfermer puis en s’évadant. Contacté par une société privée souhaitant tester un concept révolutionnaire de prison hi-tech, il se retrouve prisonnier. Piégé dans ce complexe ultra-moderne, harcelé par un directeur impitoyable et son gardien corrompu, Ray découvre une conspiration pour le faire disparaître à jamais. Sa seule chance de survie : une alliance avec Emil Rottmayer, un co-détenu ayant lui aussi un secret. Pour avoir une chance de s’évader, ils vont d’abord devoir se faire confiance.','https://fr.web.img5.acsta.net/c_310_420/pictures/210/416/21041625_20130919114531457.jpg',NULL,NULL,NULL),(135962,'Tellement proches',2009,NULL,102,4.0,NULL,3.0,NULL,'Famille : Groupe de personnes réunies par des liens de parenté et un fort sentiment de solidarité morale et matérielle. Quand Alain a épousé Nathalie, il ne savait pas qu\'il épouserait aussi sa famille. Ce samedi, comme toutes les semaines, ils sont invités à dîner chez son beau-frère, Jean-Pierre à Créteil. Mais ce soir, plus que d\'habitude, Alain est à bloc, il bout comme une cocotte prête à exploser. Il en a marre, marre de se planter à chaque fois sur le chemin pour aller à Créteil, marre de se taper les petits conseils de vie de Jean-Pierre et de sa femme Catherine qui élève ses enfants comme des chevaux, marre d\'attendre de dîner l\'estomac vide en regardant les spectacles soporifiques de leur fille Gaëlle, marre de regarder pour la énième fois la vidéo de leur mariage, marre aussi de son autre belle-soeur Roxane, qui, affolée par son horloge biologique, a jeté son dévolu sur Bruno, jeune interne en médecine qui se demande un peu comment il a atterri à ce dîner. C\'est vrai, Alain en a marre de ces dîners familiaux, mais il ne sait pas encore ce qui l\'attend véritablement ce soir-là... Ni les jours qui suivent','https://fr.web.img6.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/medias/nmedia/18/69/35/73/19099931.jpg',NULL,NULL,NULL),(137097,'Dallas Buyers Club',2014,NULL,117,4.0,NULL,4.0,NULL,'1986, Dallas, Texas, une histoire vraie. Ron Woodroof a 35 ans, des bottes, un Stetson, c’est un cow-boy, un vrai. Sa vie : sexe, drogue et rodéo. Tout bascule quand, diagnostiqué séropositif, il lui reste 30 jours à vivre. Révolté par l’impuissance du corps médical, il recourt à des traitements alternatifs non officiels. Au fil du temps, il rassemble d’autres malades en quête de guérison : le Dallas Buyers Club est né. Mais son succès gêne, Ron doit s’engager dans une bataille contre les laboratoires et les autorités fédérales. C’est son combat pour une nouvelle cause… et pour sa propre vie.','https://fr.web.img6.acsta.net/c_310_420/pictures/14/01/24/12/09/007448.jpg',NULL,NULL,NULL),(138473,'Venom',2018,NULL,112,3.0,NULL,2.0,NULL,'Possédé par un symbiote qui agit de manière autonome, le journaliste Eddie Brock devient le protecteur létal Venom.','https://fr.web.img6.acsta.net/c_310_420/pictures/18/09/20/10/41/4338768.jpg',NULL,NULL,NULL),(140140,'Animal Kingdom',2011,NULL,112,4.0,NULL,4.0,NULL,'Une rue anonyme dans la banlieue de Melbourne. C’est là que vit la famille Cody. Profession : criminels. L’irruption parmi eux de Joshua, un neveu éloigné, offre à la police le moyen de les infiltrer. Il ne reste plus à Joshua qu’à choisir son camp...','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/73/96/94/19638756.jpg',NULL,NULL,NULL),(141261,'Rouge comme le ciel',2010,NULL,100,4.0,NULL,3.0,NULL,'Mirco perd la vue à l\'âge de dix ans et doit poursuivre sa scolarité dans un institut spécialisé. Loin de son père, il ne peut plus partager avec lui sa passion du cinéma. Il trouve pourtant le moyen de donner vie aux histoires qu\'il s\'invente : il enregistre des sons sur un magnétophone puis coupe les bandes, les colle et les réécoute. L\'école très stricte n\'approuve pas du tout ses expériences et fait tout pour l\'en écarter. Mais Mirco, loin de se résigner, poursuit sa passion...','https://fr.web.img3.acsta.net/c_310_420/pictures/24/03/01/10/31/5302741.jpg',NULL,NULL,NULL),(145083,'Hunger Games',2012,NULL,142,4.0,NULL,3.0,NULL,'Chaque année, dans les ruines de ce qui était autrefois l\'Amérique du Nord, le Capitole, l\'impitoyable capitale de la nation de Panem, oblige chacun de ses douze districts à envoyer un garçon et une fille - les \"Tributs\" - concourir aux Hunger Games. A la fois sanction contre la population pour s\'être rebellée et stratégie d\'intimidation de la part du gouvernement, les Hunger Games sont un événement télévisé national au cours duquel les tributs doivent s\'affronter jusqu\'à la mort. L\'unique survivant est déclaré vainqueur.','https://fr.web.img3.acsta.net/c_310_420/medias/nmedia/18/85/51/91/20018884.jpg',NULL,NULL,NULL),(169913,'La Taupe',2012,NULL,122,3.0,NULL,4.0,NULL,'1973. La guerre froide empoisonne toujours les relations internationales. Les services secrets britanniques sont, comme ceux des autres pays, en alerte maximum. Suite à une mission ratée en Hongrie, le patron du MI6 se retrouve sur la touche avec son fidèle lieutenant, George Smiley. ','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/85/04/05/19957689.jpg',NULL,NULL,NULL),(170828,'The Greatest Showman',2018,NULL,104,4.0,NULL,3.0,NULL,'The Greatest Showman célèbre la naissance du show-business et l’émerveillement que l’on éprouve lorsque les rêves deviennent réalité. Inspirée par l’ambition et l’imagination de P.T Barnum, voici l’histoire d’un visionnaire parti de rien qui a créé un spectacle devenu un phénomène planétaire.','https://fr.web.img3.acsta.net/c_310_420/pictures/17/12/22/14/45/3862832.jpg',NULL,NULL,NULL),(172048,'Bad Boys For Life',2020,NULL,124,3.0,NULL,2.0,NULL,'Les Bad Boys Mike Lowrey et Marcus Burnett se retrouvent pour résoudre une ultime affaire.','https://fr.web.img5.acsta.net/c_310_420/pictures/19/11/22/09/44/3027567.jpg',NULL,NULL,NULL),(179616,'Godzilla',2014,NULL,123,3.0,NULL,4.0,NULL,'Le physicien Joseph Brody a perdu sa femme il y a 15 ans quand un incident nucléaire a irradié la région de Tokyo. La thèse officielle parle de tremblement de terre mais le scientifique est sceptique et mène son enquête avec son fils Ford, soldat dans la Navy. En fait de catastrophe naturelle, il s\'agit plutôt des dégâts d\'une créature gigantesque créée à la suite d\'essais nucléaires dans le Pacifique. D\'autres monstres menacent l\'archipel d\'Hawaï et la côte Ouest des Etats-Unis. L\'armée est mobilisée et menée par l\'Amiral William Stenz. Au même moment, la compagne de Ford, infirmière et jeune maman, gère les blessés dans un hôpital de San Francisco...','https://fr.web.img4.acsta.net/c_310_420/pictures/14/03/25/14/43/167915.jpg',NULL,NULL,NULL),(180899,'Indiana Jones et le Cadran de la Destinée',2023,NULL,154,4.0,NULL,4.0,NULL,'1969. Après avoir passé plus de dix ans à enseigner au Hunter College de New York, l\'estimé docteur Jones, professeur d\'archéologie, est sur le point de prendre sa retraite et de couler des jours paisibles.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/06/07/14/33/5787419.jpg',NULL,NULL,NULL),(181893,'Polisse',2011,NULL,127,4.0,NULL,4.0,NULL,'Le quotidien des policiers de la BPM (Brigade de Protection des Mineurs) ce sont les gardes à vue de pédophiles, les arrestations de pickpockets mineurs mais aussi la pause déjeuner où l’on se raconte ses problèmes de couple ; ce sont les auditions de parents maltraitants, les dépositions des enfants, les dérives de la sexualité chez les adolescents, mais aussi la solidarité entre collègues et les fous rires incontrôlables dans les moments les plus impensables ; c’est savoir que le pire existe, et tenter de faire avec… Comment ces policiers parviennent-ils à trouver l’équilibre entre leurs vies privées et la réalité à laquelle ils sont confrontés, tous les jours ? Fred, l’écorché du groupe, aura du mal à supporter le regard de Melissa, mandatée par le ministère de l’intérieur pour réaliser un livre de photos sur cette brigade.','https://fr.web.img4.acsta.net/c_310_420/medias/nmedia/18/83/94/23/19787873.jpg',NULL,NULL,NULL),(182349,'Omar m\'a tuer',2011,NULL,85,4.0,NULL,3.0,NULL,'Le 24 juin 1991, Ghislaine Marchal est retrouvée morte dans la cave de sa villa de Mougins. Des lettres de sang accusent : « Omar m’a tuer ». Quelques jours plus tard, Omar Raddad, son jardinier, est écroué à la prison de Grasse. Il parle peu, comprend mal le français, a la réputation d’être calme et sérieux. Dès lors, il est le coupable évident. Il n’en sortira que 7 ans plus tard, gracié, mais toujours coupable aux yeux de la justice. En 1994, révolté par le verdict, Pierre-Emmanuel Vaugrenard, écrivain convaincu de l’innocence d’Omar Raddad, s’installe à Nice pour mener sa propre enquête et rédiger un ouvrage sur l’affaire…','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/82/64/71/19723261.jpg',NULL,NULL,NULL),(182873,'Equalizer',2014,NULL,132,4.0,NULL,3.0,NULL,'Pour McCall, la page était tournée. Il pensait en avoir fini avec son mystérieux passé. Mais lorsqu’il fait la connaissance de Teri, une jeune fille victime de gangsters russes violents, il lui est impossible de ne pas réagir. Sa soif de justice se réveille et il sort de sa retraite pour lui venir en aide. McCall n’a pas oublié ses talents d’autrefois…','https://fr.web.img3.acsta.net/c_310_420/pictures/14/08/28/16/00/452053.jpg',NULL,NULL,NULL),(184989,'Le Garçon et le Héron',2023,NULL,123,4.0,NULL,4.0,NULL,'Après la disparition de sa mère dans un incendie, Mahito, un jeune garçon de 11 ans, doit quitter Tokyo pour partir vivre à la campagne dans le village où elle a grandi. Il s’installe avec son père dans un vieux manoir situé sur un immense domaine où il rencontre un héron cendré qui devient petit à petit son guide et l’aide au fil de ses découvertes et questionnements à comprendre le monde qui l\'entoure et percer les mystères de la vie.','https://fr.web.img6.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/23/10/16/15/34/4707733.jpg',NULL,NULL,NULL),(185293,'Dos au mur',2012,NULL,102,3.0,NULL,2.0,NULL,'Ancien flic condamné à la prison pour un vol dont il se dit innocent, Nick Cassidy a réussi à s’évader. Dans un célèbre hôtel de New York, il monte jusqu’à l’un des derniers étages et enjambe la fenêtre. Le voilà dehors, sur la corniche, au bord du vide… Lydia Mercer, négociatrice de la police, est chargée d’essayer de le convaincre de ne pas sauter. Plus la jeune femme tente de dénouer cette situation périlleuse, plus elle prend conscience que Cassidy pourrait bien avoir un autre objectif… Son geste a peut-être un rapport avec le mystérieux projet sur lequel travaille son frère. Pendant que l’ex-flic est au bord du vide et attire l’attention de toute la ville, beaucoup de choses se trament et trop de gens semblent s’intéresser à son cas. Les pièces du puzzle vont se révéler peu à peu, au risque de faire tomber beaucoup plus qu’un seul homme…','https://fr.web.img3.acsta.net/c_310_420/medias/nmedia/18/86/32/60/19863938.jpg',NULL,NULL,NULL),(186452,'Lucy',2014,NULL,89,3.0,NULL,3.0,NULL,'A la suite de circonstances indépendantes de sa volonté, une jeune étudiante voit ses capacités intellectuelles se développer à l’infini. Elle « colonise » son cerveau, et acquiert des pouvoirs illimités.','https://fr.web.img4.acsta.net/c_310_420/pictures/14/06/05/09/47/324245.jpg',NULL,NULL,NULL),(186636,'Top Gun: Maverick',2022,NULL,131,4.0,NULL,4.0,NULL,'Après avoir été l’un des meilleurs pilotes de chasse de la Marine américaine pendant plus de trente ans, Pete “Maverick\" Mitchell continue à repousser ses limites en tant que pilote d\'essai. Il refuse de monter en grade, car cela l’obligerait à renoncer à voler. Il est chargé de former un détachement de jeunes diplômés de l’école Top Gun pour une mission spéciale qu’aucun pilote n\'aurait jamais imaginée. Lors de cette mission, Maverick rencontre le lieutenant Bradley “Rooster” Bradshaw, le fils de son défunt ami, le navigateur Nick “Goose” Bradshaw. Face à un avenir incertain, hanté par ses fantômes, Maverick va devoir affronter ses pires cauchemars au cours d’une mission qui exigera les plus grands des sacrifices.','https://fr.web.img6.acsta.net/c_310_420/pictures/22/03/29/15/12/0827894.jpg',NULL,NULL,NULL),(187462,'Under the Skin',2014,NULL,108,3.0,NULL,4.0,NULL,'Une extraterrestre arrive sur Terre pour séduire des hommes avant de les faire disparaître.','https://fr.web.img3.acsta.net/c_310_420/pictures/14/05/07/15/58/238222.jpg',NULL,NULL,NULL),(194938,'Noé',2014,NULL,138,3.0,NULL,3.0,NULL,'Russell Crowe est Noé, un homme promis à un destin exceptionnel alors qu’un déluge apocalyptique va détruire le monde. La fin du monde… n’est que le commencement.','https://fr.web.img4.acsta.net/c_310_420/pictures/14/03/12/18/33/096867.jpg',NULL,NULL,NULL),(200399,'Des hommes sans loi',2012,NULL,115,4.0,NULL,3.0,NULL,'1931. Au cœur de l’Amérique en pleine Prohibition, dans le comté de Franklin en Virginie, état célèbre pour sa production d’alcool de contrebande, les trois frères Bondurant sont des trafiquants notoires : Jack, le plus jeune, ambitieux et impulsif, veut transformer la petite affaire familiale en trafic d’envergure. Il rêve de beaux costumes, d’armes, et espère impressionner la sublime Bertha… Howard, le cadet, est le bagarreur de la famille. Loyal, son bon sens se dissout régulièrement dans l’alcool qu’il ne sait pas refuser… Forrest, l’aîné, fait figure de chef et reste déterminé à protéger sa famille des nouvelles règles qu’impose un nouveau monde économique. Lorsque Maggie débarque fuyant Chicago, il la prend aussi sous sa protection. Seuls contre une police corrompue, une justice arbitraire et des gangsters rivaux, les trois frères écrivent leur légende : une lutte pour rester sur leur propre chemin, au cours de la première grande ruée vers l’or du crime.','https://fr.web.img4.acsta.net/c_310_420/medias/nmedia/18/90/46/07/20182376.jpg',NULL,NULL,NULL),(206775,'Coco',2017,NULL,105,4.0,NULL,4.0,NULL,'Depuis déjà plusieurs générations, la musique est bannie dans la famille de Miguel. Un vrai déchirement pour le jeune garçon dont le rêve ultime est de devenir un musicien aussi accompli que son idole, Ernesto de la Cruz. ','https://fr.web.img6.acsta.net/c_310_420/pictures/17/09/15/12/42/0056825.jpg',NULL,NULL,NULL),(207825,'The Grand Budapest Hotel',2014,NULL,100,4.0,NULL,4.0,NULL,'Le film retrace les aventures de Gustave H, l’homme aux clés d’or d’un célèbre hôtel européen de l’entre-deux-guerres et du garçon d’étage Zéro Moustafa, son allié le plus fidèle.','https://fr.web.img3.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/14/01/20/12/06/239820.jpg',NULL,NULL,NULL),(209525,'Jeune & Jolie',2013,NULL,94,3.0,NULL,4.0,NULL,'Le portrait d’une jeune fille de 17 ans en 4 saisons et 4 chansons.','https://fr.web.img2.acsta.net/c_310_420/pictures/210/059/21005923_2013051510325393.jpg',NULL,NULL,NULL),(210493,'Les Minions',2015,NULL,91,3.0,NULL,4.0,NULL,'A l\'origine de simples organismes monocellulaires de couleur jaune, les Minions ont évolué au cours des âges au service de maîtres plus abjectes les uns que les autres. Les disparitions répétitives de ceux-ci, des tyrannosaures à Napoléon, ont plongé les Minions dans une profonde dépression. Mais l\'un d\'eux, prénommé Kevin, a une idée. Flanqué de Stuart, l\'adolescent rebelle et de l\'adorable petit Bob, Kevin part à la recherche d\'un nouveau patron malfaisant pour guider les siens. Nos trois Minions se lancent dans un palpitant voyage qui va les conduire à leur nouveau maître : Scarlet Overkill, la première superméchante de l\'histoire. De l\'Antarctique au New York des années 60, nos trois compères arrivent finalement à Londres, où ils vont devoir faire face à la plus terrible menace de leur existence : l\'annihilation de leur espèce.','https://fr.web.img5.acsta.net/c_310_420/pictures/15/06/11/09/20/080813.jpg',NULL,NULL,NULL),(211012,'The Batman',2022,NULL,177,4.0,NULL,4.0,NULL,'Deux années à arpenter les rues en tant que Batman et à insuffler la peur chez les criminels ont mené Bruce Wayne au coeur des ténèbres de Gotham City. Avec seulement quelques alliés de confiance - Alfred Pennyworth, le lieutenant James Gordon - parmi le réseau corrompu de fonctionnaires et de personnalités de la ville, le justicier solitaire s\'est imposé comme la seule incarnation de la vengeance parmi ses concitoyens. Lorsqu\'un tueur s\'en prend à l\'élite de Gotham par une série de machinations sadiques, une piste d\'indices cryptiques envoie le plus grand détective du monde sur une enquête dans la pègre, où il rencontre des personnages tels que Selina Kyle, alias Catwoman, Oswald Cobblepot, alias le Pingouin, Carmine Falcone et Edward Nashton, alias l’Homme-Mystère. Alors que les preuves s’accumulent et que l\'ampleur des plans du coupable devient clair, Batman doit forger de nouvelles relations, démasquer le coupable et rétablir un semblant de justice au milieu de l’abus de pouvoir et de corruption sévissant à Gotham City depuis longtemps.','https://fr.web.img3.acsta.net/c_310_420/pictures/22/02/16/17/42/3125788.jpg',NULL,NULL,NULL),(212386,'Mea Culpa',2014,NULL,91,3.0,NULL,3.0,NULL,'Flics sur Toulon, Simon et Franck fêtent la fin d\'une mission. De retour vers chez eux, ils percutent une voiture. Bilan : deux victimes dont un enfant. Franck est indemne. Simon, qui était au volant et alcoolisé, sort grièvement blessé . Il va tout perdre. Sa vie de famille. Son job de flic. Six ans plus tard, divorcé de sa femme Alice, Simon est devenu convoyeur de fonds et peine à tenir son rôle de père auprès de son fils Théo qui a désormais 9 ans. Franck, toujours flic, veille à distance sur lui. Lors d\'une corrida, le petit Théo va être malgré lui le témoin d\'un règlement de compte mafieux. Très vite, il fera l\'objet de menaces. Simon va tout faire pour protéger son fils et retrouver ses poursuivants. Le duo avec Franck va au même moment se recomposer. Mais ce sera aussi pour eux l\'occasion de revenir sur les zones d\'ombre de leur passé commun. ','https://fr.web.img6.acsta.net/c_310_420/pictures/13/12/18/12/43/406041.jpg',NULL,NULL,NULL),(215094,'Star Wars: L\'Ascension de Skywalker',2019,NULL,142,3.0,NULL,3.0,NULL,'La conclusion de la saga Skywalker. De nouvelles légendes vont naître dans cette bataille épique pour la liberté.','https://fr.web.img5.acsta.net/c_310_420/pictures/20/10/02/12/21/3764004.png',NULL,NULL,NULL),(215097,'Star Wars - Le Réveil de la Force',2015,NULL,135,4.0,NULL,4.0,NULL,'Dans une galaxie lointaine, très lointaine, un nouvel épisode de la saga \"Star Wars\", 30 ans après les événements du \"Retour du Jedi\".','https://fr.web.img2.acsta.net/c_310_420/pictures/15/10/18/18/56/052074.jpg',NULL,NULL,NULL),(217882,'Gone Girl',2014,NULL,149,4.0,NULL,4.0,NULL,'À l’occasion de son cinquième anniversaire de mariage, Nick Dunne signale la disparition de sa femme, Amy. Sous la pression de la police et l’affolement des médias, l’image du couple modèle commence à s’effriter. Très vite, les mensonges de Nick et son étrange comportement amènent tout le monde à se poser la même question : a-t-il tué sa femme ?','https://fr.web.img3.acsta.net/c_310_420/pictures/14/09/11/17/05/508784.jpg',NULL,NULL,NULL),(219070,'Les Figures de l\'ombre',2017,NULL,127,4.0,NULL,3.0,NULL,'Le destin extraordinaire des trois scientifiques afro-américaines qui ont permis aux États-Unis de prendre la tête de la conquête spatiale, grâce à la mise en orbite de l’astronaute John Glenn. ','https://fr.web.img6.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/17/01/10/15/08/573198.jpg',NULL,NULL,NULL),(220846,'Passengers',2016,NULL,117,4.0,NULL,3.0,NULL,'Alors que 5000 passagers endormis pour longtemps voyagent dans l’espace vers une nouvelle planète, deux d’entre eux sont accidentellement tirés de leur sommeil artificiel 90 ans trop tôt. Jim et Aurora doivent désormais accepter l’idée de passer le reste de leur existence à bord du vaisseau spatial. Alors qu’ils éprouvent peu à peu une indéniable attirance, ils découvrent que le vaisseau court un grave danger. La vie des milliers de passagers endormis est entre leurs mains…','https://fr.web.img6.acsta.net/c_310_420/pictures/16/12/14/16/45/405336.jpg',NULL,NULL,NULL),(224808,'Les Filles du Docteur March',2020,NULL,135,4.0,NULL,4.0,NULL,'Une nouvelle adaptation des \"Quatre filles du Docteur March\" qui s’inspire à la fois du grand classique de la littérature et des écrits de Louisa May Alcott. Relecture personnelle du livre, Les filles du Docteur March est un film à la fois atemporel et actuel où Jo March, alter ego fictif de l’auteur, repense à sa vie.','https://fr.web.img6.acsta.net/c_310_420/pictures/19/11/19/12/01/5505683.jpg',NULL,NULL,NULL),(226927,'Le Cas Richard Jewell',2020,NULL,129,4.0,NULL,4.0,NULL,'En 1996, Richard Jewell fait partie de l\'équipe chargée de la sécurité des Jeux d\'Atlanta. Il est l\'un des premiers à alerter de la présence d\'une bombe et à sauver des vies. Mais il se retrouve bientôt suspecté... de terrorisme, passant du statut de héros à celui d\'homme le plus détesté des Etats-Unis. Il fut innocenté trois mois plus tard par le FBI mais sa réputation ne fut jamais complètement rétablie, sa santé étant endommagée par l\'expérience.','https://fr.web.img4.acsta.net/c_310_420/pictures/20/01/09/14/26/2410363.jpg',NULL,NULL,NULL),(228087,'Les Animaux Fantastiques : les Secrets de Dumbledore',2022,NULL,142,3.0,NULL,3.0,NULL,'Le professeur Albus Dumbledore sait que le puissant mage noir Gellert Grindelwald cherche à prendre le contrôle du monde des sorciers. Incapable de l’empêcher d’agir seul, il sollicite le magizoologiste Norbert Dragonneau pour qu’il réunisse des sorciers, des sorcières et un boulanger moldu au sein d’une équipe intrépide. Leur mission des plus périlleuses les amènera à affronter des animaux, anciens et nouveaux, et les disciples de plus en plus nombreux de Grindelwald. Pourtant, dès lors que que les enjeux sont aussi élevés, Dumbledore pourra-t-il encore rester longtemps dans l’ombre ?','https://fr.web.img6.acsta.net/c_310_420/pictures/22/03/16/15/20/0170262.jpg',NULL,NULL,NULL),(230327,'Avant toi',2016,NULL,110,4.0,NULL,3.0,NULL,'Une charmante petite ville de l\'Angleterre rurale. Si elle est originale et artiste dans l\'âme, Louisa \"Lou\" Clark, 26 ans, n\'a aucune ambition particulière. Elle se contente d\'enchaîner les boulots pour permettre à ses proches de joindre les deux bouts.','https://fr.web.img4.acsta.net/c_310_420/pictures/16/05/02/17/27/063880.jpg',NULL,NULL,NULL),(230453,'Baby Driver',2017,NULL,113,4.0,NULL,4.0,NULL,'Chauffeur pour des braqueurs de banque, Baby a un truc pour être le meilleur dans sa partie : il roule au rythme de sa propre playlist. Lorsqu’il rencontre la fille de ses rêves, Baby cherche à mettre fin à ses activités criminelles pour revenir dans le droit chemin. Mais il est forcé de travailler pour un grand patron du crime et le braquage tourne mal… Désormais, sa liberté, son avenir avec la fille qu’il aime et sa vie sont en jeu.','https://fr.web.img2.acsta.net/c_310_420/pictures/17/05/30/14/36/446691.jpg',NULL,NULL,NULL),(231786,'Love',2015,NULL,140,3.0,NULL,3.0,NULL,'Un 1er janvier au matin, le téléphone sonne. Murphy, 25 ans, se réveille entouré de sa jeune femme et de son enfant de deux ans. Il écoute son répondeur. Sur le message, la mère d\'Electra lui demande, très inquiète, s\'il n\'a pas eu de nouvelle de sa fille disparue depuis longtemps. Elle craint qu\'il lui soit arrivé un accident grave. ','https://fr.web.img5.acsta.net/c_310_420/pictures/15/05/27/16/00/104793.jpg',NULL,NULL,NULL),(238330,'Sully',2016,NULL,96,4.0,NULL,4.0,NULL,'Le 15 janvier 2009, le monde a assisté au \"miracle sur l\'Hudson\" accompli par le commandant \"Sully\" Sullenberger : en effet, celui-ci a réussi à poser son appareil sur les eaux glacées du fleuve Hudson, sauvant ainsi la vie des 155 passagers à bord. Cependant, alors que Sully était salué par l\'opinion publique et les médias pour son exploit inédit dans l\'histoire de l\'aviation, une enquête a été ouverte, menaçant de détruire sa réputation et sa carrière.','https://fr.web.img6.acsta.net/c_310_420/pictures/16/10/14/15/10/425022.jpg',NULL,NULL,NULL),(238648,'Irréprochable',2016,NULL,103,3.0,NULL,4.0,NULL,'Sans emploi depuis un an, Constance revient dans sa ville natale quand elle apprend qu’un poste se libère dans l’agence immobilière où elle a démarré sa carrière, mais son ancien patron lui préfère une autre candidate plus jeune. Constance est alors prête à tout pour récupérer la place qu’elle estime être la sienne.','https://fr.web.img3.acsta.net/c_310_420/pictures/16/06/13/16/54/002350.jpg',NULL,NULL,NULL),(239735,'La Voie de la justice',2020,NULL,137,4.0,NULL,3.0,NULL,'Le combat historique du jeune avocat Bryan Stevenson.  Après ses études à l’université de Harvard, Bryan Stevenson aurait pu se lancer dans une carrière des plus lucratives. Il décide pourtant de se rendre en Alabama pour défendre ceux qui ont été condamnés à tort, avec le soutien d’une militante locale, Eva Ansley. Un de ses premiers cas - le plus incendiaire - est celui de Walter McMillian qui, en 1987, est condamné à mort pour le meurtre retentissant d’une jeune fille de 18 ans. Et ce en dépit d’un grand nombre de preuves attestant de son innocence et d’un unique témoignage à son encontre provenant d’un criminel aux motivations douteuses. Au fil des années, Bryan se retrouve empêtré dans un imbroglio de manœuvres juridiques et politiques. Il doit aussi faire face à un racisme manifeste et intransigeant alors qu’il se bat pour Walter et d’autres comme lui au sein d’un système hostile.','https://fr.web.img5.acsta.net/c_310_420/pictures/20/01/14/09/12/0418204.jpg',NULL,NULL,NULL),(240516,'Split',2017,NULL,117,4.0,NULL,4.0,NULL,'Kevin a déjà révélé 23 personnalités, avec des attributs physiques différents pour chacune, à sa psychiatre dévouée, la docteure Fletcher, mais l’une d’elles reste enfouie au plus profond de lui. Elle va bientôt se manifester et prendre le pas sur toutes les autres. Poussé à kidnapper trois adolescentes, dont la jeune Casey, aussi déterminée que perspicace, Kevin devient dans son âme et sa chair, le foyer d’une guerre que se livrent ses multiples personnalités, alors que les divisions qui régnaient jusqu’alors dans son subconscient volent en éclats.','https://fr.web.img5.acsta.net/c_310_420/pictures/16/12/09/09/51/046535.jpg',NULL,NULL,NULL),(241020,'Charlie\'s Angels',2019,NULL,119,2.0,NULL,2.0,NULL,'Les Charlie’s Angels ont toujours assuré la sécurité de leurs clients grâce à leurs compétences hors du commun. L’agence Townsend a maintenant étendu ses activités à l’international, avec les femmes les plus intelligentes, les plus téméraires et les mieux entraînées du monde entier – de multiples équipes de Charlie’s Angels affrontant les missions les plus périlleuses, chacune guidée par son propre Bosley.','https://fr.web.img5.acsta.net/c_310_420/pictures/19/10/14/14/05/3710938.jpg',NULL,NULL,NULL),(241160,'Get Out',2017,NULL,104,4.0,NULL,4.0,NULL,'Couple mixte, Chris et sa petite amie Rose  filent le parfait amour. Le moment est donc venu de rencontrer la belle famille, Missy et Dean lors d’un week-end sur leur domaine dans le nord de l’État. Chris commence par penser que l’atmosphère tendue est liée à leur différence de couleur de peau, mais très vite une série d’incidents de plus en plus inquiétants lui permet de découvrir l’inimaginable.','https://fr.web.img2.acsta.net/c_310_420/pictures/17/03/16/13/25/487327.jpg',NULL,NULL,NULL),(242734,'Stephen King\'s Doctor Sleep',2019,NULL,152,4.0,NULL,3.0,NULL,'Un nouveau chapitre de ','https://fr.web.img5.acsta.net/c_310_420/pictures/19/10/11/11/36/5168199.jpg',NULL,NULL,NULL),(242871,'Fast & Furious X',2023,NULL,141,3.0,NULL,3.0,NULL,'Après bien des missions et contre toute attente, Dom Toretto et sa famille ont su déjouer, devancer, surpasser et distancer tous les adversaires qui ont croisé leur route. Ils sont aujourd’hui face à leur ennemi le plus terrifiant et le plus intime : émergeant des brumes du passé, ce revenant assoiffé de vengeance est bien déterminé à décimer la famille en réduisant à néant tout ce à quoi, et surtout à qui Dom ait jamais tenu. ','https://fr.web.img3.acsta.net/c_310_420/pictures/23/05/10/10/55/5129031.jpg',NULL,NULL,NULL),(245006,'Deadpool 2',2018,NULL,120,4.0,NULL,3.0,NULL,'L’insolent mercenaire de Marvel remet le masque !','https://fr.web.img2.acsta.net/c_310_420/pictures/18/04/06/16/26/2317955.jpg',NULL,NULL,NULL),(245010,'3 Billboards, Les Panneaux de la vengeance',2018,NULL,116,4.0,NULL,4.0,NULL,'Après des mois sans que l\'enquête sur la mort de sa fille ait avancé, Mildred Hayes prend les choses en main, affichant un message controversé visant le très respecté chef de la police sur trois grands panneaux à l\'entrée de leur ville.','https://fr.web.img4.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/18/03/06/09/09/1117374.jpg',NULL,NULL,NULL),(246797,'À bras ouverts',2017,NULL,93,2.0,NULL,2.0,NULL,'Figure de la scène littéraire et médiatique française, Jean-Etienne Fougerole est un intellectuel humaniste marié à une riche héritière déconnectée des réalités. Alors que Fougerole fait la promotion dans un débat télévisé de son nouveau roman « A bras ouverts », invitant les plus aisés à accueillir chez eux les personnes dans le besoin, son opposant le met au défi d\'appliquer ce qu\'il préconise dans son ouvrage. Coincé et piqué au vif, Fougerole prend au mot son adversaire et accepte le challenge pour ne pas perdre la face. Mais dès le soir-même, on sonne à la porte de sa somptueuse maison de Marnes-la-coquette… Les convictions des Fougerole vont être mises à rude épreuve !','https://fr.web.img3.acsta.net/c_310_420/pictures/17/02/03/15/32/408364.jpg',NULL,NULL,NULL),(247411,'Alibi.com',2017,NULL,90,4.0,NULL,3.0,NULL,'Greg a fondé une entreprise nommée Alibi.com qui crée tout type d\'alibi. Avec Augustin son associé, et Medhi son nouvel employé, ils élaborent des stratagèmes et mises en scène imparables pour couvrir leurs clients. Mais la rencontre de Flo, une jolie blonde qui déteste les hommes qui mentent, va compliquer la vie de Greg, qui commence par lui cacher la vraie nature de son activité. Lors de la présentation aux parents, Greg comprend que Gérard, le père de Flo, est aussi un de leurs clients...','https://fr.web.img5.acsta.net/c_310_420/pictures/16/12/22/15/06/567544.jpg',NULL,NULL,NULL),(247880,'Telle Mère, Telle Fille',2017,NULL,94,2.0,NULL,3.0,NULL,'Inséparables, Avril et sa mère Mado ne peuvent pourtant pas être plus différentes. Avril, 30 ans, est mariée, salariée et organisée à l\'inverse de sa mère, éternelle ado insouciante et délurée qui vit aux crochets de sa fille depuis son divorce. Mais quand les deux femmes se retrouvent enceintes en même temps et sous le même toit, le clash est inévitable. Parce que si Mado, en pleine crise de jeunisme, n\'est pas prête à être grand-mère, Avril, quant à elle, a bien du mal à imaginer sa mère... mère !','https://fr.web.img6.acsta.net/c_310_420/pictures/17/02/15/12/27/325795.jpg',NULL,NULL,NULL),(251105,'Wonka',2023,NULL,117,4.0,NULL,3.0,NULL,'Découvrez la jeunesse de Willy Wonka, l’extraordinaire inventeur, magicien et chocolatier de l’univers féérique de Charlie et la chocolaterie de Roald Dahl, dans le film WONKA. Timothée Chalamet incarne ce jeune homme débordant d’idées et déterminé à changer le monde… avec gourmandise ! Cette œuvre haute en couleur, mêlant émotion et humour, prouve que, dans la vie, les rêves peuvent devenir réalité – surtout si on a la chance de rencontrer Willy Wonka.','https://fr.web.img2.acsta.net/c_310_420/pictures/23/12/05/14/56/1249162.jpg',NULL,NULL,NULL),(251711,'Le Brio',2017,NULL,97,4.0,NULL,4.0,NULL,'Neïla Salah a grandi à Créteil et rêve de devenir avocate. Inscrite à la grande université parisienne d’Assas, elle se confronte dès le premier jour à Pierre Mazard, professeur connu pour ses provocations et ses dérapages. Pour se racheter une conduite, ce dernier accepte de préparer Neïla au prestigieux concours d’éloquence. A la fois cynique et exigeant, Pierre pourrait devenir le mentor dont elle a besoin… Encore faut-il qu’ils parviennent tous les deux à dépasser leurs préjugés.','https://fr.web.img5.acsta.net/c_310_420/pictures/17/09/25/10/41/2444205.jpg',NULL,NULL,NULL),(252378,'Au Poste!',2018,NULL,71,3.0,NULL,4.0,NULL,'Un poste de police. Un tête-à-tête, en garde à vue, entre un commissaire et son suspect.','https://fr.web.img4.acsta.net/c_310_420/pictures/18/05/09/17/07/4888503.jpg',NULL,NULL,NULL),(252439,'Call Me By Your Name',2018,NULL,131,4.0,NULL,4.0,NULL,'Été 1983. Elio Perlman, 17 ans, passe ses vacances dans la villa du XVIIe siècle que possède sa famille en Italie, à jouer de la musique classique, à lire et à flirter avec son amie Marzia. Son père, éminent professeur spécialiste de la culture gréco-romaine, et sa mère, traductrice, lui ont donné une excellente éducation, et il est proche de ses parents. Sa sophistication et ses talents intellectuels font d’Elio un jeune homme mûr pour son âge, mais il conserve aussi une certaine innocence, en particulier pour ce qui touche à l’amour. Un jour, Oliver, un séduisant Américain qui prépare son doctorat, vient travailler auprès du père d’Elio. Elio et Oliver vont bientôt découvrir l’éveil du désir, au cours d’un été ensoleillé dans la campagne italienne qui changera leur vie à jamais.','https://fr.web.img2.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/18/02/13/15/35/4076138.jpg',NULL,NULL,NULL),(255426,'Amanda',2018,NULL,107,4.0,NULL,4.0,NULL,'Paris, de nos jours. David, 24 ans, vit au présent. Il jongle entre différents petits boulots et recule, pour un temps encore, l’heure des choix plus engageants. Le cours tranquille des choses vole en éclats quand sa sœur aînée meurt brutalement. Il se retrouve alors en charge de sa nièce de 7 ans, Amanda.','https://fr.web.img6.acsta.net/c_310_420/pictures/18/10/17/16/34/3385152.jpg',NULL,NULL,NULL),(255512,'La Belle et la Meute',2017,NULL,100,4.0,NULL,4.0,NULL,'Lors d\'une fête étudiante, Mariam, jeune Tunisienne, croise le regard de Youssef. ','https://fr.web.img3.acsta.net/c_310_420/pictures/17/07/10/17/33/133000.jpg',NULL,NULL,NULL),(255795,'Benedetta',2021,NULL,131,3.0,NULL,4.0,NULL,'Au 17ème siècle, alors que la peste se propage en Italie, la très jeune Benedetta Carlini rejoint le couvent de Pescia en Toscane. Dès son plus jeune âge, Benedetta est capable de faire des miracles et sa présence au sein de sa nouvelle communauté va changer bien des choses dans la vie des soeurs.','https://fr.web.img3.acsta.net/c_310_420/pictures/21/05/05/15/00/1592283.jpg',NULL,NULL,NULL),(257816,'I Feel Good',2018,NULL,103,3.0,NULL,4.0,NULL,'Monique dirige une communauté Emmaüs près de Pau. Après plusieurs années d’absence, elle voit débarquer son frère, Jacques, un bon à rien qui n’a qu’une obsession : trouver l’idée qui le rendra riche. Plus que des retrouvailles familiales, ce sont deux visions du monde qui s’affrontent.','https://fr.web.img6.acsta.net/c_310_420/pictures/18/06/15/09/38/2883759.jpg',NULL,NULL,NULL),(258530,'Voyez Comme on Danse',2018,NULL,88,3.0,NULL,3.0,NULL,'Voyez comme ils dansent…','https://fr.web.img4.acsta.net/c_310_420/pictures/18/07/23/09/57/1810259.jpg',NULL,NULL,NULL),(258998,'Jojo Rabbit',2020,NULL,108,4.0,NULL,3.0,NULL,'Jojo est un petit allemand solitaire. Sa vision du monde est mise à l’épreuve quand il découvre que sa mère cache une jeune fille juive dans leur grenier. Avec la seule aide de son ami aussi grotesque qu\'imaginaire, Adolf Hitler, Jojo va devoir faire face à son nationalisme aveugle.','https://fr.web.img6.acsta.net/c_310_420/pictures/19/10/15/10/55/1009759.jpg',NULL,NULL,NULL),(259759,'L\'Appel de la forêt',2020,NULL,100,4.0,NULL,3.0,NULL,'La paisible vie domestique de Buck, un chien au grand cœur, bascule lorsqu’il est brusquement arraché à sa maison en Californie et se retrouve enrôlé comme chien de traîneau dans les étendues sauvages du Yukon canadien pendant la ruée vers l’or des années 1890. Buck va devoir s’adapter et lutter pour survivre, jusqu’à finalement trouver sa véritable place dans le monde en devenant son propre maître…','https://fr.web.img6.acsta.net/c_310_420/pictures/20/01/31/11/16/5333556.jpg',NULL,NULL,NULL),(261339,'Nightmare Alley',2022,NULL,151,4.0,NULL,4.0,NULL,'Alors qu’il traverse une mauvaise passe, le charismatique Stanton Carlisle débarque dans une foire itinérante et parvient à s’attirer les bonnes grâces d’une voyante, Zeena et de son mari Pete, une ancienne gloire du mentalisme. S’initiant auprès d’eux, il voit là un moyen de décrocher son ticket pour le succès et décide d’utiliser ses nouveaux talents pour arnaquer l’élite de la bonne société new-yorkaise des années 40. Avec la vertueuse et fidèle Molly à ses côtés, Stanton se met à échafauder un plan pour escroquer un homme aussi puissant que dangereux. Il va recevoir l’aide d’une mystérieuse psychiatre qui pourrait bien se révéler la plus redoutable de ses adversaires…','https://fr.web.img6.acsta.net/c_310_420/pictures/21/12/07/16/10/5664268.jpg',NULL,NULL,NULL),(262383,'OSS 117: Alerte rouge en Afrique noire',2021,NULL,116,3.0,NULL,3.0,NULL,'1981. Hubert Bonisseur de La Bath, alias OSS 117, est de retour. Pour cette nouvelle mission, plus délicate, plus périlleuse et plus torride que jamais, il est contraint de faire équipe avec un jeune collègue, le prometteur OSS 1001.','https://fr.web.img6.acsta.net/c_310_420/pictures/21/06/28/17/13/1668165.jpg',NULL,NULL,NULL),(263100,'Les Aventures d\'un mathématicien',2021,NULL,103,3.0,NULL,2.0,NULL,'1942, Nouveau Mexique. Stan Ulam, mathématicien polonais, rejoint un groupe secret de chercheurs venus du monde entier pour collaborer à la création de la bombe à hydrogène. Loin de sa famille restée en Europe et tiraillé entre questionnement éthique, avancée scientifique et urgence politique, il prend part à un épisode crucial de l’Histoire.','https://fr.web.img5.acsta.net/c_310_420/pictures/21/10/19/12/39/1352281.jpg',NULL,NULL,NULL),(264668,'Midsommar',2019,NULL,147,4.0,NULL,4.0,NULL,'Dani et Christian sont sur le point de se séparer quand la famille de Dani est touchée par une tragédie. Attristé par le deuil de la jeune femme, Christian ne peut se résoudre à la laisser seule et l’emmène avec lui et ses amis à un festival estival qui n’a lieu qu\'une fois tous les 90 ans et se déroule dans un village suédois isolé. ','https://fr.web.img5.acsta.net/c_310_420/pictures/19/06/21/16/39/3513823.jpg',NULL,NULL,NULL),(265905,'Hors Normes',2019,NULL,115,4.0,NULL,4.0,NULL,'Bruno et Malik vivent depuis 20 ans dans un monde à part, celui des enfants et adolescents autistes. Au sein de leurs deux associations respectives, ils forment des jeunes issus des quartiers difficiles pour encadrer ces cas qualifiés \"d\'hyper complexes\". Une alliance hors du commun pour des personnalités hors normes. ','https://fr.web.img6.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/19/08/20/16/22/2633779.jpg',NULL,NULL,NULL),(266159,'La Zone d\'intérêt',2024,NULL,105,4.0,NULL,4.0,NULL,'Le commandant d’Auschwitz, Rudolf Höss, et sa femme Hedwig s’efforcent de construire une vie de rêve pour leur famille dans une maison avec jardin à côté du camp.','https://fr.web.img6.acsta.net/c_310_420/pictures/24/01/12/14/37/2282076.jpg',NULL,NULL,NULL),(268283,'De nos frères blessés',2022,NULL,95,3.0,NULL,3.0,NULL,'1954, Hélène et Fernand tombent amoureux. Avec lui elle part pour Alger, découvre sa beauté et l’attachement que Fernand porte à son pays. Alors que l’Algérie et la France se déchirent, leur vie bascule. L’histoire vraie du combat d’un couple pour la liberté.','https://fr.web.img5.acsta.net/c_310_420/pictures/22/02/17/13/16/4113056.jpg',NULL,NULL,NULL),(268603,'Le Visiteur du futur',2022,NULL,102,3.0,NULL,3.0,NULL,'2555. Dans un futur dévasté, l’apocalypse menace la Terre. Le dernier espoir repose sur un homme capable de voyager dans le temps. Sa mission : retourner dans le passé et changer le cours des événements. Mais la Brigade Temporelle, une police du temps, le traque à chaque époque. Débute alors une course contre la montre pour le Visiteur du Futur…','https://fr.web.img4.acsta.net/c_310_420/pictures/22/08/23/14/53/3574724.jpg',NULL,NULL,NULL),(268966,'Trois Mille ans à t’attendre',2022,NULL,109,4.0,NULL,4.0,NULL,'Alithea Binnie, bien que satisfaite par sa vie, porte un regard sceptique sur le monde. Un jour, elle rencontre un génie qui lui propose d’exaucer trois vœux en échange de sa liberté. Mais Alithea est bien trop érudite pour ignorer que, dans les contes, les histoires de vœux se terminent mal. Il plaide alors sa cause en lui racontant son passé extraordinaire. Séduite par ses récits, elle finit par formuler un vœu des plus surprenants.','https://fr.web.img2.acsta.net/c_310_420/pictures/22/07/26/14/18/2447514.jpg',NULL,NULL,NULL),(269509,'Dark Waters',2020,NULL,128,4.0,NULL,4.0,NULL,'Robert Bilott est un avocat spécialisé dans la défense des industries chimiques. Interpellé par un paysan, voisin de sa grand-mère, il va découvrir que la campagne idyllique de son enfance est empoisonnée par une usine du puissant groupe chimique DuPont, premier employeur de la région. Afin de faire éclater la vérité sur la pollution mortelle due aux rejets toxiques de l’usine, il va risquer sa carrière, sa famille, et même sa propre vie...','https://fr.web.img4.acsta.net/c_310_420/pictures/20/01/23/14/05/1683095.jpg',NULL,NULL,NULL),(269684,'The French Dispatch',2021,NULL,108,3.0,NULL,4.0,NULL,' met en scène un recueil d’histoires tirées du dernier numéro d’un magazine américain publié dans une ville française fictive du 20e siècle.','https://fr.web.img5.acsta.net/c_310_420/pictures/21/07/05/10/50/4043397.jpg',NULL,NULL,NULL),(269946,'Le Sommet des Dieux',2021,NULL,95,4.0,NULL,4.0,NULL,'A Katmandou, le reporter japonais Fukamachi croit reconnaître Habu Jôji, cet alpiniste que l\'on pensait disparu depuis des années. Il semble tenir entre ses mains un appareil photo qui pourrait changer l’histoire de l’alpinisme. Et si George Mallory et Andrew Irvine étaient les premiers hommes à avoir atteint le sommet de l’Everest, le 8 juin 1924 ? Seul le petit Kodak Vest Pocket avec lequel ils devaient se photographier sur le toit du monde pourrait livrer la vérité. 70 ans plus tard, pour tenter de résoudre ce mystère, Fukamachi se lance sur les traces de Habu. Il découvre un monde de passionnés assoiffés de conquêtes impossibles et décide de l’accompagner jusqu’au voyage ultime vers le sommet des dieux.','https://fr.web.img2.acsta.net/c_310_420/pictures/21/07/29/17/38/3976490.jpg',NULL,NULL,NULL),(270235,'Aquaman et le Royaume perdu',2023,NULL,124,2.0,NULL,2.0,NULL,'Black Manta, toujours hanté par le désir de venger son père, est maintenant plus puissant que jamais avec le légendaire Trident Noir entre ses mains. Pour l’anéantir, Aquaman doit s’associer à son frère Orm ancien roi d’Atlantide et actuellement emprisonné. Ensemble, ils devront surmonter leurs différences pour protéger leur royaume et sauver le monde d’une destruction irréversible.','https://fr.web.img3.acsta.net/c_310_420/pictures/23/12/14/16/49/3331945.jpg',NULL,NULL,NULL),(271387,'Reminiscence',2021,NULL,116,3.0,NULL,3.0,NULL,'Dans un futur proche, Miami a été submergé par les flots, suite aux effets du changement climatique. Un enquêteur privé, Nick Bannister, est engagé par des clients afin de retrouver leurs précieux souvenirs. Au cours de sa dernière affaire, il tombe éperdument amoureux de sa cliente. A sa disparition, le détective est désemparé et se lance à sa recherche. Il se retrouve alors perdu dans une boucle temporelle et découvre des aspects de sa personnalité qu\'il ne connaissait pas auparavant.','https://fr.web.img3.acsta.net/c_310_420/pictures/21/07/28/10/29/3991427.jpg',NULL,NULL,NULL),(271676,'Le Menu',2022,NULL,108,3.0,NULL,3.0,NULL,'Un couple se rend sur une île isolée pour dîner dans un des restaurants les plus en vogue du moment, en compagnie d’autres invités triés sur le volet. Le savoureux menu concocté par le chef va leur réserver des surprises aussi étonnantes que radicales...','https://fr.web.img6.acsta.net/c_310_420/pictures/22/10/12/12/20/5889028.jpg',NULL,NULL,NULL),(271839,'Il n\'y a pas d\'ombre dans le désert',2024,NULL,101,2.0,NULL,3.0,NULL,'À Tel Aviv, Ori croise par hasard Anna, une écrivaine française, lors du procès d’un ancien Nazi. Il est bouleversé de reconnaître cette femme dont le souvenir le hante depuis qu’ils se sont follement aimés à Turin, 20 ans plus tôt. Mais Anna soutient qu\'ils ne se sont jamais rencontrés. Peut-être qu’au milieu du désert, les choses deviendront plus claires…','https://fr.web.img2.acsta.net/c_310_420/pictures/24/01/25/09/04/2620263.jpg',NULL,NULL,NULL),(272012,'Attention au départ !',2021,NULL,93,2.0,NULL,3.0,NULL,'Rater le train, c\'est moche. Alors le voir partir avec vos enfants et ceux de vos amis dont vous avez la charge, c’est une autre histoire… Celle de la folle course-poursuite de Benjamin, papa poule un peu dépassé et Antoine, grand-père fantasque, qui doivent trouver une solution avant qu’on apprenne… qu’ils ont perdu les gosses ! Rattraper le train est leur seule chance de se rattraper...','https://fr.web.img2.acsta.net/c_310_420/pictures/21/06/01/12/13/0776737.jpg',NULL,NULL,NULL),(272238,'La Méthode Williams',2021,NULL,145,4.0,NULL,3.0,NULL,'Focus sur la personnalité de l\'entraîneur de tennis Richard Williams, père des joueuses mondiales Vénus et Serena. Il n\'avait aucune expérience dans le sport mais lorsque ses filles ont eu quatre ans, il a élaboré un plan de 78 pages décrivant l\'entraînement des futures championnes. Les sœurs Williams sont devenues deux des plus grandes joueuses de l\'histoire du tennis. Serena est sans conteste la meilleure tenniswoman de tous les temps, avec 23 victoires en tournois du Grand Chelem. Venus Williams a remporté sept titres en Grand Chelem.','https://fr.web.img3.acsta.net/c_310_420/pictures/21/10/28/12/17/1157439.jpg',NULL,NULL,NULL),(273348,'Pleasure',2021,NULL,109,3.0,NULL,4.0,NULL,'Une jeune suédoise de 20 ans arrive à Los Angeles dans le but de faire carrière dans l’industrie du porno. Sa détermination et son ambition la propulsent au sommet d’un monde où le plaisir cède vite la place au risque et à la toxicité.','https://fr.web.img6.acsta.net/c_310_420/pictures/21/10/13/09/15/1601456.jpg',NULL,NULL,NULL),(274234,'Les Trolls 3',2023,NULL,92,3.0,NULL,3.0,NULL,'Après deux films à se tourner autour pour finalement tomber dans les bras l’un de l’autre, Poppy et Branch sont officiellement en couple (#broppy)! Alors qu’ils n’ont plus de secrets l’un pour l’autre, Poppy fait une découverte incroyable relative au passé de Branch. À l’époque, avec ses quatre frères, Floyd, John Dory, Spruce et Clay, ils formaient le Boys Band le plus en vogue du moment, les BroZone. Alors qu’il n’était qu’un enfant, le groupe s’est séparé, tout comme la famille et depuis Branch n’a jamais revu ses frères.','https://fr.web.img2.acsta.net/c_310_420/pictures/23/10/23/18/06/2138941.jpg',NULL,NULL,NULL),(275207,'Thor: Love And Thunder',2022,NULL,119,2.0,NULL,3.0,NULL,'Alors que Thor est en pleine introspection et en quête de sérénité, sa retraite est interrompue par un tueur galactique connu sous le nom de Gorr, qui s’est donné pour mission d’exterminer tous les dieux. Pour affronter cette menace, Thor demande l’aide de Valkyrie, de Korg et de son ex-petite amie Jane Foster, qui, à sa grande surprise, manie inexplicablement son puissant marteau, le Mjolnir. Ensemble, ils se lancent dans une dangereuse aventure cosmique pour comprendre les motivations qui poussent Gorr à la vengeance et l’arrêter avant qu’il ne soit trop tard.','https://fr.web.img5.acsta.net/c_310_420/pictures/22/05/24/11/16/2411535.jpg',NULL,NULL,NULL),(275394,'Stella, une vie allemande',2024,NULL,121,4.0,NULL,3.0,NULL,'Stella, grandit à Berlin sous le régime nazi. Elle rêve d\'une carrière de chanteuse de jazz, malgré toutes les mesures répressives. Finalement contrainte de se cacher avec ses parents en 1944, sa vie se transforme en une tragédie coupable. ','https://fr.web.img4.acsta.net/c_310_420/pictures/23/12/14/09/35/5786378.jpg',NULL,NULL,NULL),(276716,'Hommes au bord de la crise de nerfs',2022,NULL,97,3.0,NULL,3.0,NULL,'Sept hommes, de 17 à 70 ans, que tout oppose, sinon d’être au bord de la crise de nerfs, se retrouvent embarqués dans une thérapie de groupe en pleine nature sauvage. Ce stage mystérieux, « exclusivement réservé aux hommes », est censé faire des miracles. Première surprise à leur arrivée : le coach est une femme ! Imprévisible et déroutante, elle va tout faire pour les aider à aller mieux. Avec ou sans leur consentement…','https://fr.web.img4.acsta.net/c_310_420/pictures/21/12/06/10/29/3281222.jpg',NULL,NULL,NULL),(277726,'Rien à foutre',2022,NULL,115,3.0,NULL,4.0,NULL,'Cassandre, 26 ans, est hôtesse de l’air dans une compagnie low-cost. Vivant au jour le jour, elle enchaîne les vols et les fêtes sans lendemain, fidèle à son pseudo Tinder «Carpe Diem». Une existence sans attaches, en forme de fuite en avant, qui la comble en apparence. Alors que la pression de sa compagnie redouble, Cassandre finit par perdre pied. Saura-t-elle affronter les douleurs enfouies et revenir vers ceux qu\'elle a laissés au sol ?','https://fr.web.img2.acsta.net/c_310_420/pictures/22/02/11/15/59/0440387.jpg',NULL,NULL,NULL),(278742,'Dune : Deuxième Partie',2024,NULL,166,4.0,NULL,4.0,NULL,'Dans DUNE : DEUXIÈME PARTIE, Paul Atreides s’unit à Chani et aux Fremen pour mener la révolte contre ceux qui ont anéanti sa famille. Hanté par de sombres prémonitions, il se trouve confronté au plus grand des dilemmes : choisir entre l’amour de sa vie et le destin de l’univers.','https://fr.web.img2.acsta.net/c_310_420/pictures/24/01/26/10/18/5392835.jpg',NULL,NULL,NULL),(280197,'Le Temps D’Aimer',2023,NULL,125,4.0,NULL,4.0,NULL,'1947. Sur une plage, Madeleine, serveuse dans un hôtel-restaurant, mère d’un petit garçon, fait la connaissance de François, étudiant riche et cultivé. Entre eux, c’est comme une évidence. La providence. Si l’on sait ce qu’elle veut laisser derrière elle en suivant ce jeune homme, on découvre avec le temps ce que François tente de fuir en mêlant le destin de Madeleine au sien...','https://fr.web.img5.acsta.net/c_310_420/pictures/23/11/09/14/17/3474118.jpg',NULL,NULL,NULL),(280227,'La Bête Dans La Jungle',2023,NULL,100,2.0,NULL,3.0,NULL,'La Bête dans la jungle, librement adapté de la nouvelle de Henry James, est l’histoire d’un huis clos vertigineux : pendant 25 ans, dans une immense boîte de nuit, un homme et une femme guettent ensemble un événement mystérieux. De 1979 à 2004, l’histoire du disco à la techno, l’histoire d’un amour, l’histoire d’une obsession. La « chose » finalement se manifestera, mais sous une forme autrement plus tragique que prévu.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/06/30/10/58/4389327.jpg',NULL,NULL,NULL),(281295,'Stars At Noon',2023,NULL,138,2.0,NULL,2.0,NULL,'Une jeune journaliste américaine en détresse bloquée sans passeport dans le Nicaragua d’aujourd’hui en pleine période électorale rencontre dans un bar d’hôtel un voyageur anglais. Il lui semble être l’homme rêvé pour l’aider à fuir le pays. Elle réalise trop tard qu’au contraire, elle entre à ses côtés dans un monde plus trouble, plus dangereux.','https://fr.web.img3.acsta.net/c_310_420/pictures/23/04/04/18/00/3615273.jpg',NULL,NULL,NULL),(283583,'La Montagne',2023,NULL,112,3.0,NULL,4.0,NULL,'Pierre, ingénieur parisien, se rend dans les Alpes pour son travail. Irrésistiblement attiré par les montagnes, il s’installe un bivouac en altitude et décide de ne plus redescendre. Là-haut, il fait la rencontre de Léa et découvre de mystérieuses lueurs.','https://fr.web.img5.acsta.net/c_310_420/pictures/23/02/01/16/28/5510102.jpg',NULL,NULL,NULL),(283915,'Beau Is Afraid',2023,NULL,179,3.0,NULL,4.0,NULL,'Beau tente désespérément de rejoindre sa mère. Mais l’univers semble se liguer contre lui…','https://fr.web.img4.acsta.net/c_310_420/pictures/23/04/05/11/32/2503739.jpg',NULL,NULL,NULL),(284676,'Les Passagers de la nuit',2022,NULL,111,4.0,NULL,4.0,NULL,'Paris, années 80. Elisabeth vient d’être quittée par son mari et doit assurer le quotidien de ses deux adolescents, Matthias et Judith. Elle trouve un emploi dans une émission de radio de nuit, où elle fait la connaissance de Talulah, jeune fille désœuvrée qu’elle prend sous son aile. Talulah découvre la chaleur d’un foyer et Matthias la possibilité d’un premier amour, tandis qu’Elisabeth invente son chemin, pour la première fois peut-être. Tous s’aiment, se débattent... leur vie recommencée ?','https://fr.web.img5.acsta.net/c_310_420/pictures/22/04/12/16/01/3361793.jpg',NULL,NULL,NULL),(284846,'Bullet Train',2022,NULL,127,4.0,NULL,3.0,NULL,'Coccinelle est un assassin malchanceux et particulièrement déterminé à accomplir sa nouvelle mission paisiblement après que trop d\'entre elles aient déraillé. Mais le destin en a décidé autrement et l\'embarque dans le train le plus rapide au monde aux côtés d\'adversaires redoutables qui ont tous un point commun, mais dont les intérêts divergent radicalement... Il doit alors tenter par tous les moyens de descendre du train.','https://fr.web.img6.acsta.net/c_310_420/pictures/22/07/13/11/36/3514892.jpg',NULL,NULL,NULL),(286292,'Bolero',2024,NULL,120,3.0,NULL,3.0,NULL,'En 1928, alors que Paris vit au rythme des années folles, la danseuse Ida Rubinstein commande à Maurice Ravel la musique de son prochain ballet. Tétanisé et en panne d’inspiration, le compositeur feuillette les pages de sa vie - les échecs de ses débuts, la fracture de la Grande Guerre, l’amour impossible qu’il éprouve pour sa muse Misia Sert… Ravel va alors plonger au plus profond de lui-même pour créer son oeuvre universelle, le Bolero.','https://fr.web.img5.acsta.net/c_310_420/pictures/24/01/26/11/07/0253122.jpg',NULL,NULL,NULL),(287057,'La Brigade',2022,NULL,97,4.0,NULL,3.0,NULL,'Depuis toute petite, Cathy rêve de diriger son propre restaurant. Mais à quarante ans, rien ne s\'est passé comme prévu et elle se retrouve contrainte d\'accepter un poste de cantinière dans un foyer pour jeunes migrants. Son rêve semble encore s’éloigner… ou pas ?','https://fr.web.img5.acsta.net/c_310_420/pictures/22/02/09/15/16/1331267.jpg',NULL,NULL,NULL),(287538,'La Chambre des merveilles',2023,NULL,99,4.0,NULL,4.0,NULL,'La vie toute tracée de Thelma prend un détour tragique lorsqu’un accident plonge son fils Louis, 12 ans, dans le coma. Déterminée à le réveiller par tous les moyens, elle va faire le pari fou d’accomplir une par une les « 10 choses à faire avant la fin du monde » qu’il avait inscrites dans son journal intime, pour lui montrer tout ce que la vie a de magnifique à lui offrir. Mais ce voyage dans les rêves de son adolescent l’emmènera bien plus loin que ce qu’elle imaginait... jusqu’à raviver son propre goût à la vie.','https://fr.web.img5.acsta.net/c_310_420/pictures/23/01/30/11/03/5822497.jpg',NULL,NULL,NULL),(288263,'Acide',2023,NULL,100,2.0,NULL,3.0,NULL,'Selma, 15 ans, grandit entre ses deux parents séparés, Michal et Élise. Des nuages de pluies acides et dévastatrices s’abattent sur la France. Dans un monde qui va bientôt sombrer, cette famille fracturée va devoir s’unir pour affronter cette catastrophe climatique et tenter d’y échapper.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/05/17/16/23/3337241.jpg',NULL,NULL,NULL),(288269,'La Syndicaliste',2023,NULL,121,4.0,NULL,3.0,NULL,'Un matin, Maureen Kearney est violemment agressée chez elle. Elle travaillait sur un dossier sensible dans le secteur nucléaire français et subissait de violentes pressions politiques. Les enquêteurs ne retrouvent aucune trace des agresseurs… Est-elle victime ou coupable de dénonciation mensongère ? ','https://fr.web.img6.acsta.net/c_310_420/pictures/23/02/17/16/21/5693290.jpg',NULL,NULL,NULL),(288667,'Burning Days',2023,NULL,131,4.0,NULL,4.0,NULL,'Emre, un jeune procureur déterminé et inflexible, vient d’être nommé dans une petite ville reculée de Turquie. À peine arrivé, il se heurte aux notables locaux bien décidés à défendre leurs privilèges par tous les moyens, même les plus extrêmes.','https://fr.web.img6.acsta.net/c_310_420/pictures/22/09/05/10/24/2243533.jpg',NULL,NULL,NULL),(289226,'Universal Theory',2024,NULL,118,3.0,NULL,4.0,NULL,'1962 : lors d’un congrès de physique dans les Alpes suisses, le jeune Johannes défend une théorie sur l’existence de mondes parallèles. Mais personne n’y croit, pas même son tuteur. Les mystères s\'accumulent pourtant : une curieuse formation nuageuse dans le ciel ; la présence fantomatique de Karin, cette jeune pianiste qui l’obsède et semble tout savoir de lui… Et ces personnes victimes d’accidents étranges dans la montagne ? Le réel semble bien fragile en ce lieu.','https://fr.web.img2.acsta.net/c_310_420/pictures/24/01/15/09/22/4468633.jpg',NULL,NULL,NULL),(289239,'L\'Étoile filante',2024,NULL,98,3.0,NULL,3.0,NULL,'Bruxelles, aujourd’hui. Boris, barman, vit dans la clandestinité depuis 35 ans, à la suite de son implication dans un attentat qui a mal tourné. Son passé refait surface quand une victime le retrouve et veut se venger. L’apparition de Dom, homme dépressif qui ressemble comme deux gouttes d’eau à Boris, fournit à l’ex- activiste le moyen parfait pour échapper à la vengeance. Boris et sa compagne, Kayoko, épaulés par leur portier, Tim, tissent une toile funeste autour de Dom. Ils ignorent l’existence de son ex-femme, Fiona, détective privée...','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/18/13/35/3063057.jpg',NULL,NULL,NULL),(289843,'La Conférence',2023,NULL,108,4.0,NULL,3.0,NULL,'Au matin du 20 janvier 1942, une quinzaine de dignitaires du IIIe Reich se retrouvent dans une villa cossue à Wannsee, conviés par Reinhard Heydrich à une mystérieuse conférence. Ils en découvrent le motif à la dernière minute : ces représentants de la Waffen SS ou du Parti, fonctionnaires des différents ministères, émissaires des provinces conquises, apprennent qu’ils devront s’être mis d’accord avant midi sur un plan d’élimination du peuple juif, appelé Solution Finale. Deux heures durant vont alors se succéder débats, manœuvres et jeux de pouvoir, autour de ce qui fera basculer dans la tragédie des millions de destins.','https://fr.web.img4.acsta.net/c_310_420/pictures/23/03/14/15/35/5416892.jpg',NULL,NULL,NULL),(290065,'Pauvres Créatures',2024,NULL,141,4.0,NULL,4.0,NULL,'Bella est une jeune femme ramenée à la vie par le brillant et peu orthodoxe Dr Godwin Baxter. Sous sa protection, elle a soif d’apprendre. Avide de découvrir le monde dont elle ignore tout, elle s\'enfuit avec Duncan Wedderburn, un avocat habile et débauché, et embarque pour une odyssée étourdissante à travers les continents. Imperméable aux préjugés de son époque, Bella est résolue à ne rien céder sur les principes d’égalité et de libération.','https://fr.web.img5.acsta.net/c_310_420/pictures/23/11/28/11/03/2973866.jpg',NULL,NULL,NULL),(290443,'Avant l’effondrement',2023,NULL,100,3.0,NULL,3.0,NULL,'Dans un Paris caniculaire, Tristan, directeur de campagne d’une candidate aux législatives, reçoit un courrier anonyme contenant un test de grossesse positif. Parce qu’il est peut-être atteint d’une maladie génétique mortelle et incurable, il devient obsédé par l’idée de retrouver la femme qui lui a envoyé ce test. Mais a-t-il affaire à une blague morbide, une vengeance froide, un appel à l’aide ou à une manœuvre politique ? Tristan décide de mener l’enquête, au péril de sa vie professionnelle et affective.','https://fr.web.img5.acsta.net/c_310_420/pictures/23/03/23/12/04/5580706.jpg',NULL,NULL,NULL),(290915,'Novembre',2022,NULL,107,4.0,NULL,4.0,NULL,'Une plongée au cœur de l’Anti-Terrorisme pendant les 5 jours d\'enquête qui ont suivi les attentats du 13 novembre.','https://fr.web.img3.acsta.net/c_310_420/pictures/22/08/22/12/13/2509103.jpg',NULL,NULL,NULL),(291483,'Coupez!',2022,NULL,112,4.0,NULL,4.0,NULL,'Un tournage de film de zombies dans un bâtiment désaffecté. Entre techniciens blasés et acteurs pas vraiment concernés, seul le réalisateur semble investi de l’énergie nécessaire pour donner vie à un énième film d\'horreur à petit budget. L’irruption d’authentiques morts-vivants va perturber le tournage…','https://fr.web.img5.acsta.net/c_310_420/pictures/22/04/27/12/42/5834908.jpg',NULL,NULL,NULL),(291709,'Magnificat',2023,NULL,97,3.0,NULL,2.0,NULL,'À la mort d’un prêtre, la chancelière du diocèse découvre abasourdie qu’il s’agissait d’une femme ! Contre l’avis de son évêque qui souhaite étouffer l’affaire, elle mène l’enquête pour comprendre comment et avec quelles complicités une telle imposture a été possible...','https://fr.web.img3.acsta.net/c_310_420/pictures/23/05/24/16/38/1362258.jpg',NULL,NULL,NULL),(291804,'Les Têtes givrées',2023,NULL,102,4.0,NULL,3.0,NULL,'Dans un collège au pied du Mont Blanc, les élèves de SEGPA peinent à entrevoir un avenir positif... Pour les motiver et les faire rêver, Alain, leur professeur, organise une sortie surprenante et périlleuse dans les entrailles d’un glacier. Les adolescents découvrent alors un monde de glace d\'une beauté à couper le souffle. Mais ils réalisent qu’avec le réchauffement climatique, si rien n’est fait, ce glacier comme beaucoup d’autres pourrait disparaitre. Contre l’avis de tous, mais entraînés par leur professeur, ils vont se lancer corps et âmes dans un projet fou : protéger le glacier et l’empêcher de fondre… Désormais plus rien ne pourra les arrêter, parce qu’il n’y a pas de planète B !','https://fr.web.img2.acsta.net/c_310_420/pictures/22/12/01/13/12/4159161.jpg',NULL,NULL,NULL),(291879,'Saw X',2023,NULL,118,3.0,NULL,3.0,NULL,'John Kramer, le tueur au puzzle, est de retour dans le volet le plus perturbant de la franchise SAW. Les événements se situent entre SAW I et II, on y retrouve un John, malade et désespéré, qui se rend au Mexique afin de subir une opération expérimentale capable de guérir son cancer, mais il découvre que tout ceci n’est qu’une escroquerie visant des malades vulnérables et affligés. Animé d\'un nouveau but, le célèbre tueur en série retourne à son œuvre, et va prendre sa revanche sur ces escrocs dans un terrible « jeu » dont il a le secret, à travers des pièges toujours plus machiavéliques et ingénieux les uns que les autres.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/07/27/18/03/4072864.jpg',NULL,NULL,NULL),(292377,'Visions',2023,NULL,123,3.0,NULL,3.0,NULL,'Pilote de ligne confirmée, Estelle mène, entre deux vols long-courriers, une vie parfaite avec Guillaume, son mari aimant et protecteur. Un jour, par hasard, dans un couloir d’aéroport, elle recroise la route d’Ana, photographe avec qui elle a eu une aventure passionnée vingt ans plus tôt. Estelle est alors loin d’imaginer que ces retrouvailles vont l’entraîner dans une spirale cauchemardesque et faire basculer sa vie dans l’irrationnel…','https://fr.web.img3.acsta.net/c_310_420/pictures/23/08/01/13/52/4599315.jpg',NULL,NULL,NULL),(292799,'Rue des dames',2023,NULL,97,2.0,NULL,3.0,NULL,'Mia, 25 ans, employée dans un petit salon de manucure dans le 18e à Paris, apprend qu’elle est enceinte. Il lui faut trouver d’urgence un nouvel appartement alors que son copain Nabil, en liberté conditionnelle, peine à joindre les deux bouts. Lancée dans une frénétique course contre la montre, Mia monte une combine impliquant des clientes du salon, des soirées privées, et un footballeur-star. Cette fois, elle n’a plus le choix : elle doit reprendre son destin en main.','https://fr.web.img4.acsta.net/c_310_420/pictures/23/10/18/10/16/1069425.jpg',NULL,NULL,NULL),(293265,'À l\'intérieur',2023,NULL,105,2.0,NULL,3.0,NULL,'Nemo, cambrioleur chevronné, se retrouve piégé dans un luxueux appartement new-yorkais. Essentiellement décoré d\'œuvres d\'art, il va devoir faire preuve de créativité et de ténacité pour survivre et tenter de s\'échapper...','https://fr.web.img2.acsta.net/c_310_420/pictures/23/09/07/14/26/0134840.jpg',NULL,NULL,NULL),(293378,'Les SEGPA',2022,NULL,99,2.0,NULL,2.0,NULL,'Les SEGPA se font virer de leur établissement. À leur grande surprise, ils intègrent le prestigieux collège Franklin D. Roosevelt.','https://fr.web.img3.acsta.net/c_310_420/pictures/22/02/04/17/58/3314454.jpg',NULL,NULL,NULL),(293604,'May December',2024,NULL,117,3.0,NULL,4.0,NULL,'Pour préparer son nouveau rôle, une actrice célèbre vient rencontrer celle qu’elle va incarner à l’écran, dont la vie sentimentale a enflammé la presse à scandale et passionné le pays 20 ans plus tôt.','https://fr.web.img2.acsta.net/c_310_420/pictures/23/09/06/09/03/2490223.jpg',NULL,NULL,NULL),(293633,'SISU - De l\'Or et du Sang',2023,NULL,91,3.0,NULL,3.0,NULL,'Finlande, 1944. Dans la nature sauvage et hostile de la Laponie, alors occupée par les nazis, un ancien soldat découvre un gisement d’or.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/04/27/11/02/2355439.jpg',NULL,NULL,NULL),(293898,'Soudain seuls',2023,NULL,111,4.0,NULL,3.0,NULL,'En couple depuis 5 ans, Ben et Laura ont décidé de faire le tour du monde en bateau. Avant d\'atteindre l\'Amérique du Sud, ils font un détour vers une île sauvage, près des côtes antarctiques. En pleine exploration, une tempête s\'abat sur eux et leur bateau disparaît. Éloignés du monde, soudain seuls face au danger et à l\'hiver qui approche, ils vont devoir lutter pour leur survie et celle de leur couple.','https://fr.web.img4.acsta.net/c_310_420/pictures/23/09/25/10/58/2824182.jpg',NULL,NULL,NULL),(294000,'Mon héroïne',2022,NULL,108,3.0,NULL,3.0,NULL,'Depuis son plus jeune âge, Alex ne rêve que d\'une chose : réaliser des films. Mais à Rouen, son quotidien est bien loin du glamour hollywoodien. Surprotégée par sa mère Mathilde, elle espère intégrer une prestigieuse école de cinéma à New York. Malheureusement, tout ne se passe pas comme prévu et ses rêves sont brutalement brisés. Refusant d’accepter son sort, Alex décide de partir pour la grosse pomme avec l’aide de son excentrique tante Juliette pour un projet fou : donner son scénario à Julia Roberts. Vite rejointes par Mathilde, cette aventure new-yorkaise va marquer pour les trois femmes le début d’une nouvelle étape de leur vie et les rapprocher plus que jamais.','https://fr.web.img2.acsta.net/c_310_420/pictures/22/09/08/15/49/1852262.jpg',NULL,NULL,NULL),(294092,'Jeff Panacloc - À la poursuite de Jean-Marc',2023,NULL,90,3.0,NULL,2.0,NULL,'Jeff Panacloc et Jean-Marc, le duo qui a conquis des millions de spectateurs, débarque pour la première fois au cinéma ! ','https://fr.web.img4.acsta.net/c_310_420/pictures/23/09/22/13/11/4039583.jpg',NULL,NULL,NULL),(294240,'La Salle des profs',2024,NULL,99,4.0,NULL,4.0,NULL,'Alors qu\'une série de vols a lieu en salle des profs, Carla Nowak mène l\'enquête dans le collège où elle enseigne. Très vite, tout l\'établissement est ébranlé par ses découvertes.','https://fr.web.img3.acsta.net/c_310_420/pictures/24/01/31/10/38/5852912.jpg',NULL,NULL,NULL),(294401,'Les Volets verts',2022,NULL,97,3.0,NULL,3.0,NULL,'\"Les Volets verts\" dresse le portrait d’un monstre sacré, Jules Maugin, un acteur au sommet de sa gloire dans les années 70. Sous la personnalité célèbre, l’intimité d’un homme se révèle.','https://fr.web.img5.acsta.net/c_310_420/pictures/22/06/14/15/38/5035891.jpg',NULL,NULL,NULL),(295634,'Conann',2023,NULL,105,2.0,NULL,4.0,NULL,'Parcourant les abîmes, le chien des enfers Rainer raconte les six vies de Conann, perpétuellement mise à mort par son propre avenir, à travers les époques, les mythes et les âges. Depuis son enfance, esclave de Sanja et de sa horde barbare, jusqu\'à son accession aux sommets de la cruauté aux portes de notre monde.','https://fr.web.img2.acsta.net/c_310_420/pictures/23/10/09/12/19/4526951.jpg',NULL,NULL,NULL),(296168,'Oppenheimer',2023,NULL,181,4.0,NULL,4.0,NULL,'En 1942, convaincus que l’Allemagne nazie est en train de développer une arme nucléaire, les États-Unis initient, dans le plus grand secret, le \"Projet Manhattan\" destiné à mettre au point la première bombe atomique de l’histoire. Pour piloter ce dispositif, le gouvernement engage J. Robert Oppenheimer, brillant physicien, qui sera bientôt surnommé \"le père de la bombe atomique\". C’est dans le laboratoire ultra-secret de Los Alamos, au cœur du désert du Nouveau-Mexique, que le scientifique et son équipe mettent au point une arme révolutionnaire dont les conséquences, vertigineuses, continuent de peser sur le monde actuel…','https://fr.web.img3.acsta.net/c_310_420/pictures/23/05/26/16/52/2793170.jpg',NULL,NULL,NULL),(298874,'20 000 espèces d\'abeilles',2024,NULL,128,4.0,NULL,4.0,NULL,'Cocó, huit ans, a bien du mal à savoir qui elle est. Au cours d’un été passé parmi les ruches du Pays Basque, elle éveille sa singularité au sein des femmes de sa famille, elles-mêmes en proie au doute. Dans un monde où il existe 20 000 espèces d’abeilles différentes, il existe forcément une identité qui corresponde à Cocó…','https://fr.web.img6.acsta.net/c_310_420/pictures/23/10/12/11/06/0853085.jpg',NULL,NULL,NULL),(299937,'Le Procès Goldman',2023,NULL,116,4.0,NULL,4.0,NULL,'En avril 1976, débute le deuxième procès de Pierre Goldman, militant d’extrême gauche, condamné en première instance à la réclusion criminelle à perpétuité pour quatre braquages à main armée, dont un ayant entraîné la mort de deux pharmaciennes. Il clame son innocence dans cette dernière affaire et devient en quelques semaines l’icône de la gauche intellectuelle. Georges Kiejman, jeune avocat, assure sa défense. Mais très vite, leurs rapports se tendent. Goldman, insaisissable et provocateur, risque la peine capitale et rend l’issue du procès incertaine.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/06/27/12/21/2686698.jpg',NULL,NULL,NULL),(300484,'Making Of',2024,NULL,114,3.0,NULL,4.0,NULL,'Simon, réalisateur aguerri, débute le tournage d’un film racontant le combat d’ouvriers pour sauver leur usine. Mais entre les magouilles de son producteur, des acteurs incontrôlables et des techniciens à cran, il est vite dépassé par les événements. Abandonné par ses financiers, Simon doit affronter un conflit social avec sa propre équipe. Dans ce tournage infernal, son seul allié est le jeune figurant à qui il a confié la réalisation du making of.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/08/09/30/4432840.jpg',NULL,NULL,NULL),(302951,'Le Ravissement',2023,NULL,97,4.0,NULL,4.0,NULL,'Comment la vie de Lydia, sage-femme très investie dans son travail, a-t-elle déraillé ? Est-ce sa rupture amoureuse, la grossesse de sa meilleure amie Salomé, ou la rencontre de Milos, un possible nouvel amour ? Lydia s’enferme dans une spirale de mensonges et leur vie à tous bascule....','https://fr.web.img6.acsta.net/c_310_420/pictures/23/08/31/16/29/0547250.jpg',NULL,NULL,NULL),(304537,'Gueules noires',2023,NULL,103,3.0,NULL,3.0,NULL,'1956, dans le nord de la France. Une bande de mineurs de fond se voit obligée de conduire un professeur faire des prélèvements à mille mètres sous terre. Après un éboulement qui les empêche de remonter, ils découvrent une crypte d’un autre temps, et réveillent sans le savoir quelque chose qui aurait dû rester endormi.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/10/10/10/41/5993062.jpg',NULL,NULL,NULL),(304573,'Scandaleusement vôtre',2024,NULL,100,4.0,NULL,3.0,NULL,'Littlehampton, 1920. Lorsque Edith Swan commence à recevoir des lettres anonymes truffées d\'injures, Rose Gooding, sa voisine irlandaise à l’esprit libre et au langage fleuri, est rapidement accusée des crimes. Toute la petite ville, concernée par cette affaire, s’en mêle. L\'officière de police Gladys Moss, rapidement suivie par les femmes de la ville, mène alors sa propre enquête : elles soupçonnent que quelque chose cloche et que Rose pourrait ne pas être la véritable coupable, victime des mœurs abusives de son époque...','https://fr.web.img5.acsta.net/c_310_420/pictures/24/01/30/11/42/4484085.jpg',NULL,NULL,NULL),(304576,'The Old Oak',2023,NULL,113,4.0,NULL,3.0,NULL,'TJ Ballantyne est le propriétaire du \"Old Oak\", un pub situé dans une petite bourgade du nord de l’Angleterre. Il y sert quotidiennement les mêmes habitués désœuvrés pour qui l’endroit est devenu le dernier lieu où se retrouver. L’arrivée de réfugiés syriens va créer des tensions dans le village. TJ va cependant se lier d’amitié avec Yara, une jeune migrante passionnée par la photographie. Ensemble, ils vont tenter de redonner vie à la communauté locale en développant une cantine pour les plus démunis, quelles que soient leurs origines.','https://fr.web.img4.acsta.net/c_310_420/pictures/23/09/20/09/08/2713358.jpg',NULL,NULL,NULL),(304685,'Mon Crime',2023,NULL,103,4.0,NULL,4.0,NULL,'Dans les années 30 à Paris, Madeleine Verdier, jeune et jolie actrice sans le sou et sans talent, est accusée du meurtre d’un célèbre producteur. Aidée de sa meilleure amie Pauline, jeune avocate au chômage, elle est acquittée pour légitime défense. Commence alors une nouvelle vie, faite de gloire et de succès, jusqu’à ce que la vérité éclate au grand jour…','https://fr.web.img2.acsta.net/c_310_420/pictures/23/01/10/15/13/3810364.jpg',NULL,NULL,NULL),(305389,'Les Feuilles mortes',2023,NULL,81,4.0,NULL,4.0,NULL,'Deux personnes solitaires se rencontrent par hasard une nuit à Helsinki et chacun tente de trouver en l’autre son premier, unique et dernier amour. Mais la vie a tendance à mettre des obstacles sur la route de ceux qui cherchent le bonheur.','https://fr.web.img5.acsta.net/c_310_420/pictures/23/08/21/15/37/1770745.jpg',NULL,NULL,NULL),(305544,'Iron Claw',2024,NULL,133,4.0,NULL,4.0,NULL,'Les inséparables frères Von Erich ont marqué l’histoire du catch professionnel du début des années 80. Entrainés de main de fer par un père tyrannique, ils vont devoir se battre sur le ring et dans leur vie. Entre triomphes et tragédies, cette nouvelle pépite produite par A24 est inspirée de leur propre histoire.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/22/17/09/3537863.jpg',NULL,NULL,NULL),(305756,'Dans la mêlée',2024,NULL,134,0.0,NULL,4.0,NULL,'Les tensions sont vives dans un club de rugby Londonien : l’équipe est à court d’argent et divisée. C’est dans ce contexte électrique que lors d’une soirée arrosée, Mark, une nouvelle recrue, couche avec Warren, un de ses coéquipiers les plus populaires. Le hic, c’est qu’ils sont tous les deux déjà en couple. Les deux hommes doivent dissimuler leurs sentiments grandissants en conciliant leurs propres vulnérabilités et les démonstrations de machisme sur le terrain. Ou risquer de détruire le club qu’ils affectionnent.','https://fr.web.img6.acsta.net/c_310_420/pictures/24/02/07/09/23/0863240.jpg',NULL,NULL,NULL),(306156,'Le Retour',2023,NULL,107,3.0,NULL,3.0,NULL,'Khédidja travaille pour une famille parisienne aisée qui lui propose de s\'occuper des enfants le temps d’un été en Corse. L\'opportunité pour elle de retourner avec ses filles, Jessica et Farah, sur cette île qu\'elles ont quittée quinze ans plus tôt dans des circonstances tragiques. ','https://fr.web.img6.acsta.net/c_310_420/pictures/23/06/12/15/24/2366267.jpg',NULL,NULL,NULL),(306540,'Walk Up',2024,NULL,97,3.0,NULL,4.0,NULL,'Byungsoo, un réalisateur célèbre, accompagne sa fille chez une amie de longue date, propriétaire d\'un immeuble à Gangnam. La visite des lieux entraîne pour Byungsoo un voyage hors du temps où se dessinent, à chaque étage, ses amours passés et à venir. Fin portraitiste, Hong Sangsoo transforme le quotidien d\'un immeuble en puzzle des relations humaines. Un terrain de jeu qui explore les désirs, les regrets, les rêves, et bien sûr, le cinéma.','https://fr.web.img6.acsta.net/c_310_420/pictures/24/01/25/17/23/5945071.jpg',NULL,NULL,NULL),(307775,'Iris et les hommes',2024,NULL,98,2.0,NULL,3.0,NULL,'Un mari formidable, deux filles parfaites, un cabinet dentaire florissant : tout va bien pour Iris. Mais depuis quand n’a-t-elle pas fait l’amour ? Peut-être est-il temps de prendre un amant. S\'inscrivant sur une banale appli de rencontre, Iris ouvre la boite de Pandore. Les hommes vont tomber… Comme s’il en pleuvait !','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/20/10/50/5902027.jpg',NULL,NULL,NULL),(307806,'Dans la peau de Blanche Houellebecq',2024,NULL,88,3.0,NULL,3.0,NULL,'En Guadeloupe, Blanche Gardin préside un concours de sosie consacré à Michel Houellebecq. Michel s’y rend, mais des événements imprévus vont plonger notre duo au cœur d’une intrigue rocambolesque…','https://fr.web.img3.acsta.net/c_310_420/pictures/24/01/25/10/07/2642043.jpg',NULL,NULL,NULL),(310110,'La Vie de ma mère',2024,NULL,103,4.0,NULL,4.0,NULL,'Pierre, 33 ans, fleuriste à succès, voit sa vie basculer lorsque sa mère, Judith, fantasque et excessive, débarque dans sa vie après deux ans sans se voir. Pierre n’a qu’une idée, reprendre le cours normal de sa vie, mais rien ne se passe comme prévu. Leurs retrouvailles, aussi inattendues qu’explosives, vont transformer Pierre et Judith à jamais.','https://fr.web.img4.acsta.net/c_310_420/pictures/24/01/22/15/31/1839923.jpg',NULL,NULL,NULL),(311559,'Le Château Solitaire dans le Miroir',2023,NULL,116,4.0,NULL,4.0,NULL,'Un beau jour, le miroir dans la chambre de Kokoro se met à scintiller. À peine la jeune fille l’a-t-elle effleuré qu’elle se retrouve dans un formidable château digne d’un conte de fées. Là, une mystérieuse fillette affublée d’un masque de loup lui soumet un défi. Elle a un an pour l’accomplir et ainsi réaliser un souhait. Seulement Kokoro n’est pas seule : six autres adolescents ont le même objectif qu’elle.','https://fr.web.img3.acsta.net/c_310_420/pictures/23/07/27/11/52/5879491.jpg',NULL,NULL,NULL),(311631,'Karaoké',2024,NULL,89,3.0,NULL,3.0,NULL,'Après une soirée pleine d’excès, Bénédicte, célèbre chanteuse d’opéra, voit sa carrière s’écrouler. Fatou, passionnée de karaoké, est la seule à lui tendre la main. Elle a une idée derrière la tête : convaincre Bénédicte de participer au grand concours national de karaoké. La parfaite maîtrise vocale de l’une et la ténacité de l’autre pourraient bien faire des étincelles et les amener très loin.','https://fr.web.img2.acsta.net/c_310_420/pictures/23/12/14/16/16/5709345.jpg',NULL,NULL,NULL),(311895,'Vermines',2023,NULL,106,4.0,NULL,4.0,NULL,'Face à une invasion d\'araignées, les habitants d\'un immeuble vont devoir survivre.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/30/11/13/5779947.jpg',NULL,NULL,NULL),(313044,'Le Royaume des abysses',2024,NULL,112,4.0,NULL,3.0,NULL,'Shenxiu, une fillette de 10 ans, est aspirée dans les profondeurs marines durant une croisière familiale. Elle découvre l’univers fantastique des abysses, un monde inconnu peuplé d’incroyables créatures. Dans ce lieu mystérieux émerge le Restaurant des abysses, dirigé par l’emblématique Capitaine Nanhe. Poursuivis par le Fantôme Rouge, leur route sera semée d’épreuves et de nombreux secrets. Leur odyssée sous-marine ne fait que commencer.','https://fr.web.img5.acsta.net/c_310_420/pictures/23/12/01/14/15/3412210.jpg',NULL,NULL,NULL),(313204,'Rivière de nuit',2024,NULL,104,0.0,NULL,3.0,NULL,'Kiwa Funaki travaille à la teinturerie de son père à Kyoto. Cette femme indépendante et talentueuse y conçoit des tissus et accessoires qu’elle commercialise elle-même jusqu’à Tokyo. À bientôt trente ans, son entourage aimerait la voir mariée mais Kiwa trouve son épanouissement dans son art. Un jour, elle fait la rencontre de M. Takemura, professeur à l’université d’Osaka. Ce client singulier et érudit, au demeurant marié et père de famille, trouble la jeune femme...','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/21/11/45/5518693.jpg',NULL,NULL,NULL),(313397,'Comme un fils',2024,NULL,102,3.0,NULL,3.0,NULL,'Jacques Romand est un professeur qui a perdu sa vocation. Témoin d’une agression dans une épicerie de quartier, il permet l’arrestation de l’un des voleurs : Victor, 14 ans. Mais en découvrant le sort de ce gamin déscolarisé que l’on force à voler pour survivre, Jacques va tout mettre en œuvre pour venir en aide à ce jeune parti sur de si mauvais rails. Quitte à affronter ceux qui l’exploitent. En luttant contre les réticences mêmes de Victor pour tenter de lui offrir un avenir meilleur, Jacques va changer son propre destin...','https://fr.web.img5.acsta.net/c_310_420/pictures/24/02/05/11/47/5329264.jpg',NULL,NULL,NULL),(313914,'Maison de retraite 2',2024,NULL,102,3.0,NULL,3.0,NULL,'Quand le foyer Lino Vartan - qui accueille jeunes orphelins et seniors- doit fermer pour raisons sanitaires, Milann n’a pas d’autre choix que de répondre à l’invitation d’une maison de retraite dans le Sud qui les accueille pour l’été. Tous embarquent dans le bus d’Alban. Enfants et anciens découvrent alors le Bel Azur Club, une villa idyllique au bord de la mer : le rêve ! Une aubaine pour ces gamins orphelins qui n’ont jamais eu de vacances... Mais le paradis tourne à l’enfer car anciens et nouveaux pensionnaires du 3e âge se détestent ! La guerre des seniors est déclarée !','https://fr.web.img3.acsta.net/c_310_420/pictures/23/11/28/14/21/0273666.jpg',NULL,NULL,NULL),(315227,'Si seulement je pouvais hiberner',2024,NULL,98,4.0,NULL,4.0,NULL,'Ulzii, un adolescent d’un quartier défavorisé d’Oulan-Bator, est déterminé à gagner un concours de sciences pour obtenir une bourse d’étude. Sa mère, illettrée, trouve un emploi à la campagne les abandonnant lui, son frère et sa sœur, en dépit de la dureté de l’hiver. Déchiré entre la nécessité de s’occuper de sa fratrie et sa volonté d’étudier pour le concours, Ulzii n’a pas le choix : il doit accepter de se mettre en danger pour subvenir aux besoins de sa famille.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/30/10/45/5693448.jpg',NULL,NULL,NULL),(316138,'Heureux gagnants',2024,NULL,103,4.0,NULL,4.0,NULL,'1 chance sur 19 millions. Plus de probabilité d’être frappé par une météorite que de gagner au loto. Pour nos heureux gagnants, le rêve va rapidement se transformer en cauchemar, et leur vie va voler en éclat dans un spectaculaire feu d’artifices de comédie noire et de sensations fortes.','https://fr.web.img6.acsta.net/c_310_420/pictures/24/01/17/11/50/4118109.jpg',NULL,NULL,NULL),(316875,'Les SEGPA au ski',2023,NULL,102,1.0,NULL,2.0,NULL,'Les Segpa se retrouvent pour une nouvelle année scolaire riche en aventures, propulsés directement en Terminale. Deux challenges majeurs les attendent : la réussite de leur bac et leur participation soudaine aux Olympiades d’hiver inter-lycées.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/10/24/15/24/3478223.jpg',NULL,NULL,NULL),(316881,'Le Royaume de Kensuke',2024,NULL,84,4.0,NULL,4.0,NULL,'L’incroyable histoire de Michael, 11 ans, parti faire un tour du monde à la voile avec ses parents, avant qu’une terrible tempête ne le propulse par-dessus bord avec sa chienne Stella. Échoués sur une île déserte, comment survivre ? Un mystérieux inconnu vient alors à leur secours en leur offrant à boire et à manger. C’est Kensuké, un ancien soldat japonais vivant seul sur l’île avec ses amis les orangs-outans depuis la guerre. Il ouvre à Michael les portes de son royaume et lorsque des trafiquants de singes tentent d’envahir l’île, c’est ensemble qu’ils uniront leurs forces pour sauver ce paradis...','https://fr.web.img3.acsta.net/c_310_420/pictures/23/10/06/09/10/3585927.jpg',NULL,NULL,NULL),(317077,'Rose, petite fée des fleurs',2024,NULL,75,3.0,NULL,3.0,NULL,'Rose est une petite fée qui a toujours vécu seule dans son rosier. Elle rêve passionnément d’avoir un ou une ami(e), mais a trop peur de l’inconnu pour s’éloigner de son repaire. Un jour, Satin, un papillon à la recherche d’aventures, croise le chemin de Rose et elles deviennent immédiatement amies, malgré leurs différences. Satin veut partir à la découverte du monde, et quant à elle, Rose préfère rester tranquille dans son rosier. Mais, lorsque sa nouvelle amie est kidnappée par une méchante Troll de Pierre, Rose doit surmonter ses peurs et se lancer dans un dangereux voyage jusqu’aux Montagnes noires pour sauver Satin.','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/21/11/36/4465693.jpg',NULL,NULL,NULL),(318060,'Godzilla Minus One',2023,NULL,124,4.0,NULL,4.0,NULL,'Le Japon se remet à grand peine de la Seconde Guerre mondiale qu’un péril gigantesque émerge au large de Tokyo. Koichi, un kamikaze déserteur traumatisé par sa première confrontation avec Godzilla, voit là l’occasion de racheter sa conduite pendant la guerre.','https://fr.web.img4.acsta.net/c_310_420/pictures/24/01/03/11/55/3350041.jpg',NULL,NULL,NULL);
