INSERT INTO `pivot_film_api` VALUES ('Kathy Bates|Paul Brightwell|Frances Fisher|Tricia O\'Neil|Suzy Amis|Bill Paxton|Jonathan Hyde|Charlotte Chatton|Erik Holland|Seth Adkins|Ioan Gruffudd|Van Ling|Bernard Hill|Danny Nucci|Victor Garber|Camilla Overbye Roos|Kate Winslet|Richard Graham|Marc Cass|Jenette Goldstein|Leonardo DiCaprio|Jonathan Phillips|Barry Dennen|Simon Crane|Craig Kelly|Billy Zane|James Lancaster|Rosalind Ayres|Bernard Fox|Ewan Stewart|Michael Ensign|Anne Fletcher|Jason Barry|Eric Braeden|Mark Lindsay Chapman|Ron Donachie|Gloria Stuart|Martin Laing|David Warner|Lewis Abernathy','James Cameron',194,498212,5818,'Drame|Romance','https://fr.web.img6.acsta.net/c_310_420/pictures/23/01/10/16/06/0622119.jpg',4.9,'7 janvier 1998','Paramount Pictures,Lightstorm Entertainment,20th Century Studios,Digital Domain,Industrial Light & Magic (ILM),The Walt Disney Company France,The Walt Disney Company France','Southampton, 10 avril 1912. Le paquebot le plus grand et le plus moderne du monde, réputé pour son insubmersibilité, le \"Titanic\", appareille pour son premier voyage. Quatre jours plus tard, il heurte un iceberg. A son bord, un artiste pauvre et une grande bourgeoise tombent amoureux.','Titanic',4.3),('Phil M. Rosenberg|Keith David|Monique Pelletier|Ben Stiller|Markie Post|Jackie Flynn|Hillary Matthews|Heather Rosbeck|Chris Elliott|Michael Murphy|Lin Shaye|Zen Gesner|David Shackelford|Ed Nelson|Chris (III)|Lenny Clarke|Tommy Larkins|Peter Grundy|Scott Rosenberg|Lee Evans|Billy Daniels|Dave Goryl|Matt Dillon|W. Earl Brown|Cameron Diaz|Sam|Michael Burke|Richard Jenkins|Richard Tyson|Jeffrey Tambor|Khandi Alexander|Sarah Silverman|Will Coogan|Willie Garson|Steve Sweeney|Duana Knight|Steve Tyler|Rob Moran|Clem Franek|Jonathan Richman','Peter Farrelly',119,573347,18478,'Comédie','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/14/14/11/3909229.jpg',4,'11 novembre 1998','Les Acacias,Les Acacias,20th Century Studios','Ted, le ','Mary à tout prix',3.5),('0','Andrew Adamson',89,730850,27415,'Famille|Animation|Comédie|Fantastique','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/00/00/00/66/69199338_af.jpg',4.3,'4 juillet 2001','DreamWorks SKG,Pacific Data Images,United International Pictures (UIP)','Shrek, un ogre verdâtre, cynique et malicieux, a élu domicile dans un marécage qu\'il croit être un havre de paix. Un matin, alors qu\'il sort faire sa toilette, il découvre de petites créatures agaçantes qui errent dans son marais.','Shrek',4.2),('Fred Testot|Jamel Debbouze|Bernard Farcy|Gérard Depardieu|Cyril Raffaelli|Philippe Chany|Michel Cremades|Patrick Bordier|Chantal Lauby|Claude Berri|Monica Bellucci|Edouard Montoute|Destin Lenord|Louis Leterrier|Pascal Vincent|Jean-Pierre Bacri|Edouard Baer|Claude Rich|Jean-Paul Rouve|Fatou N\'Diaye|Gérard Darmon|Dieudonné|Noémie Lenoir|Christian Clavier|Pierre Tchernia|Maurice Barthélémy|Pierre-François Martin-Laval|Joel Cantona|Emma de Caunes|Zinedine Soualem|Jean Benguigui|Dominique Farrugia|Mathieu Kassovitz|Dominique Besnehard|Mouss Diouf|Marina Foïs|Omar Sy|Alex Berger|Isabelle Nanty','Alain Chabat',112,3685097,28537,'Comédie','https://fr.web.img3.acsta.net/c_310_420/pictures/23/06/21/12/06/4953335.jpg',3.8,'30 janvier 2002','Renn Productions,Pathé,Pathé,TF1 Films Production,Katharina,Chez Wam','Cléopâtre, la reine d’Égypte, décide, pour défier l\'Empereur romain Jules César, de construire en trois mois un palais somptueux en plein désert. Si elle y parvient, celui-ci devra concéder publiquement que le peuple égyptien est le plus grand de tous les peuples. Pour ce faire, Cléopâtre fait appel à Numérobis, un architecte d\'avant-garde plein d\'énergie. S\'il réussit, elle le couvrira d\'or. S\'il échoue, elle le jettera aux crocodiles.','Astérix et Obélix : Mission Cléopâtre',4.1),('John DeSantis|Edward Woodall|Robert Pugh|Jack Randall|Chris Larkin|Richard McCabe|Ian Mercer|Ousmane Thiam|Mark Lewis Jones|Alex Palmer|Billy Boyd|Max Benitz|Tony Dolan|George Innes|James D\'Arcy|Patrick Gallagher|Lee Ingleby|Max Pirkis|David Threlfall|William Mannering|Richard Pates|Paul Bettany|Russell Crowe|Thierry Segall|Bryan Dick|Joseph Morgan','Peter Weir',138,391951,28538,'Aventure|Guerre|Historique','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/35/15/63/18364956.jpg',4.2,'31 décembre 2003','20th Century Studios,United International Pictures (UIP)','En 1805, le capitaine Jack Aubrey est une des figures les plus brillantes de la Marine Royale britannique. Son courage, sa ténacité, son sens tactique lui ont valu le respect et l\'admiration des officiers et matelots du vaisseau de guerre Surprise.','Master & Commander : de l\'autre côté du monde',3.6),('Tom Berenger|Dr. Dre|Samantha Esteban|Peter Greene|Denzel Washington|Eva Mendes|Cliff Curtis|Charlotte Ayanna|Gary A. Rodriguez|Snoop Dogg|Terry Crews|Nancy Young|Raymond Cruz|Macy Gray|Noel Gugliemi|Harris Yulin|Raymond J. Barry|Nick Chinlund|Scott Glenn|Jaime Gomez|Ethan Hawke','Antoine Fuqua',121,245701,29232,'Thriller|Policier|Drame','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/68/61/99/19425646.jpg',3.1,'7 novembre 2001','Warner Bros.,Outlaw Productions,Village Roadshow Pictures,NPV Entertainment,Warner Bros. France','Jake Hoyt est une nouvelle recrue de la police de Los Angeles. Décidé à devenir inspecteur, il sollicite une mise à l\'essai de 24 heures auprès du sergent-chef Alonzo Harris, un vétéran de la lutte antidrogue qui opère depuis douze ans dans les quartiers les plus chauds de la ville.','Training Day',3.9),('Jamie Waylett|Julie Walters|John Hurt|John Cleese|Zoë Wanamaker|Terence Bayler|Richard Bremmer|Simon Fisher-Becker|Katharine Nicholson|Elizabeth Spriggs|Richard Harris|Harry Melling|Alfred Enoch|Luke Youngblood|Alan Rickman|Matthew Lewis|Maggie Smith|Rupert Grint|David Bradley (IV)|Robbie Coltrane|Devon Murray|James Phelps|Warwick Davis|Will Theakston|Fiona Shaw|Oliver Phelps|Chris Rankin|Emma Watson|Sean Biggerstaff|Daniel Radcliffe|Ian Hart|Derek Deadman|Ray Fearon|Tom Felton|Verne Troyer|Bonnie Wright|Josh Herdman|Richard Griffiths|Geraldine Somerville|Nina Young','Chris Columbus',152,2316734,29276,'Famille|Aventure|Fantastique','https://fr.web.img6.acsta.net/c_310_420/pictures/18/07/02/17/25/3643090.jpg',3.7,'5 décembre 2001','Warner Bros.,Warner Bros. France,Warner Bros. France,Heyday Films','Orphelin, Harry Potter a été recueilli à contrecœur par son oncle Vernon et sa tante Pétunia, aussi cruels que mesquins, qui n\'hésitent pas à le faire dormir dans le placard sous l\'escalier. Constamment maltraité, il doit en outre supporter les jérémiades de son cousin Dudley, garçon cupide et archi-gâté par ses parents. De leur côté, Vernon et Pétunia détestent leur neveu dont la présence leur rappelle sans cesse le tempérament \"imprévisible\" des parents du garçon et leur mort mystérieuse.','Harry Potter à l\'école des sorciers',4.1),('Marilyne Canto|Julia Vaidis-Bogard|Jacques Dutronc|Saïda Jawad|Julie Leibowitch|Emmanuelle Riva|Jacques Spiesser|Annie Grégorio|Patrick Lizana|Nathan Pavillon-Barré|Lucien Jean-Baptiste|Sandrine Bonnaire','Jean-Pierre Améris',113,205565,35370,'Comédie dramatique','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/00/02/31/70/affvie.jpg',3.3,'7 novembre 2001','France 3 Cinéma,Cofimages 2,Pan Européenne Edition,Pan Européenne Edition,Gimages 4,Productions René Goscinny','Dimitri, 49 ans, est un homme très malade. Il rejoint \"La Maison\", un lieu où sont accueillies des personnes pour qui la médecine ne peut plus rien. Il y fait la rencontre de Suzanne, une bénévole qui se consacre à l\'accompagnement des gens en fin de vie.','C\'est La Vie',3.5),('Liv Tyler|Andy Serkis|Ian Holm|Bruce Spence|Thomas Robins|Elijah Wood|Karl Urban|Sala Baker|David Aston|Royd Tolkien|Billy Boyd|Sean Bean|Jed Brophy|John Bach|Ian Hughes|Bernard Hill|Marton Csokas|Alexandra Astin|Noel Appleby|Pete Smith (II)|Lawrence Makoare|Paul Norell|David Wenham|Cate Blanchett|Bruce Hopkins|Hugo Weaving|Sarah McLeod|Alistair Browning|Viggo Mortensen|Brad Dourif|Ian McKellen|Christopher Lee|Harry Sinclair|John Rhys-Davies|Miranda Otto|Dominic Monaghan|Sean Astin|Orlando Bloom|John Noble','Peter Jackson',201,2935984,39187,'Aventure|Fantastique','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/35/14/33/18366630.jpg',3.8,'17 décembre 2003','New Line Cinema,WingNut Films,Warner Bros. France','Les armées de Sauron ont attaqué Minas Tirith, la capitale de Gondor. Jamais ce royaume autrefois puissant n\'a eu autant besoin de son roi. Mais Aragorn trouvera-t-il en lui la volonté d\'accomplir sa destinée ?','Le Seigneur des anneaux : le retour du roi',4.5),('Taryn Manning|Adam Brook|Malik Barnhardt|Na\'Keya Snoddy|Craig Chandler|Hom|Anthony Mackie|Proof|Melissa Zaglanikzny|Mekhi Phifer|Day Golfin|DJ Head|Strike|Evan Jones|Michael Bell|Venicia Foreman|Miz-Korona|Kim Basinger|Eminem|Chloe Greenfield|Jennifer Kitchen|Larry Hudson|Omar Benson Miller|Abdul Salaam El Razzac|Waverly W. Alford II|Kyla Womack|Eugene Byrd|Bushman|Mary Hannigan|Steven Monroe|Xzibit|Mike Bell|Njeri Earth|Obie Trice|Brittany Murphy|Paul Bates|Nashawn Breedlove|Michael Shannon|Allen Adams','Curtis Hanson',110,922854,41011,'Musical|Drame','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/00/02/46/93/affiche.jpg',3.8,'26 février 2003','Universal Pictures,United International Pictures (UIP)','A Detroit, en 1995, Jimmy Smith Jr. a des rêves plein la tête, mais il lui manque encore les mots pour les exprimer. Sa vie d\'adolescent se déroule entre banlieue blanche et quartiers noirs, le long de cette ligne de démarcation que l\'on nomme ','8 Mile',3.7),('Sam Neill|Rose Byrne|Fayssal Bazzi|Marianne Jean-Baptiste|Deborah Rock|Domhnall Gleeson|Felix Williamson','Will Gluck',90,495488,44792,'Famille|Aventure','https://fr.web.img5.acsta.net/c_310_420/pictures/18/04/05/15/25/1052693.jpg',3.5,'4 avril 2018','Sony Pictures Releasing France,Animal Logic,Animal Logic,Olive Bridge Entertainment,Animal Logic Entertainment','Le petit lapin préféré des jeunes lecteurs depuis des générations est désormais le héros d’un film plein d’aventures et d’espièglerie ! L\'éternelle lutte de Pierre Lapin avec M. McGregor pour les légumes du potager va atteindre des sommets. Sans parler de leur rivalité pour plaire à cette charmante voisine qui adore les animaux… Bien au-delà du jardin, de nombreuses péripéties les entraîneront de la magnifique région des lacs en Angleterre jusqu’à Londres !','Pierre Lapin',3.7),('Sanaa Lathan|O.L. Duke|Peggy Sheffield|Sharlene Garcia|Neil Brown Jr.|Ed Amatrudo|Denzel Washington|David J. Negron Sr.|Jesse Beaton|Dean Cain|Steve Raulerson|Eva Mendes|Veryl Jones|Robert Baker|John Billingsley|Dottie Healy|Antoni Corone|Alex Carter|Ron Madoff|Eric Hissom|Evelyn Brooks|Suzanne Grant|Tom Hillmann|Mike Pniewski|Tim Ware|James Murtaugh|Parris Buckner|Elena Maria Garcia|Terry Loughlin|Arian Waring Ash|Nora Dunn|Al Quinn','Carl Franklin',105,117652,45644,'Action|Thriller|Policier','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/18/35/17/93/18369270.jpg',2.8,'6 janvier 2004','UFD,Amazon MGM,Original Films,Monarch Pictures','Matt Lee Whitlock est le chef de la police de Banyan Key en Floride. Respecté par ses pairs et apprécié par les habitants, il dirige une équipe de quatre policiers incluant sa femme, l\'inspecteur Alex Diaz, dont il est sur le point de divorcer. Whitlock a renoué avec sa petite amie, Ann, mariée à un footballeur déchu au tempérament violent, Chris. Un jour, celle-ci lui déclare qu\'elle souffre d\'un cancer. Son seul espoir : se rendre en Europe pour y suivre un traitement expérimental, mais elle est à court d\'argent.','Out of Time',2.7),('Teagle F. Bougere|Mike Piazza|Dorian Missick|Francie Swift|John Cunningham|Veanne Cox|Norah Jones|Sandra Bullock|Donald Trump|Mark Zeisler|Janine LaManna|Becky Ann Baker|David Aaron Baker|Jason Antoon|Iraida Polanco|Hugh Grant|Johnny Dee|Tim Kang|Jose Ramón Rosario|Shannon Fiedler|Libby West|Elizabeth Owens|Nadine Mozon|Sharon Wilkins|Rocco Musacchia|Dana Ivey|Jonathan Dokuchitz|Adam Grupper|Sebastian Rand|Katheryn Winnick|Mark Feuerstein|Wynter Kullman|George Gearhart King III|Alicia Witt|Adam LeFevre|Heather Burns|William Thourlby|David Haig|Robert Klein|Charlotte Maier','Marc Lawrence (II)',101,252238,45854,'Comédie|Romance','https://fr.web.img6.acsta.net/c_310_420/medias/nmedia/00/02/57/88/aff.jpg',2.9,'19 février 2003','Castle Rock Entertainment,Warner Bros. France,Fortis Films','Le millionnaire Georges Wade ne prend aucune décision sans consulter Lucy Kelson, sa conseillère multi-fonction en chef à la Wade Corporation. Brillante avocate et fin stratège, elle a aussi un ulcère et ne dort pas beaucoup. Ce n\'est pas son travail qui en est la cause mais George. Intelligent, charmeur et totalement centré sur lui-même, il la traite plus comme sa nourrice que comme une avocate sortant de Harvard. Aujourd\'hui, après avoir tout régi pendant cinq ans, de ses vêtements à son divorce, Lucy Kelson a décidé de démissionner.','L\'Amour sans préavis',2.4),('Christo Jivkov|Rosalinda Celentano|Francesco De Vito|Toni Bertorelli|Monica Bellucci|Roberto Bestazzoni|Mattia Sbragia|Abel Jafri|Sergio Rubini|Pedro Sarubbi|Matt Patresi|Jim Caviezel|Emilio De Marchi (II)|Giacinto Ferro|Claudia Gerini|Maia Morgenstern|Luca Lionello|Jarreth J. Merz|Giovanni Capalbo|Francesco Cabras','Mel Gibson',127,613700,47326,'Biopic|Drame|Historique','https://fr.web.img2.acsta.net/c_310_420/medias/nmedia/18/35/22/44/18375186.jpg',2.4,'31 mars 2004','Icon Productions,Saje Distribution','Les douze dernières heures de la vie du Christ. Rendu au Mont des Oliviers, Jésus prie après avoir partagé un dernier repas avec ses apôtres. Il résiste maintenant aux tentations de Satan. Trahi par Judas, Jésus est arrêté et emmené à Jérusalem, où les chefs des Pharisiens l\'accusent de blasphème et lui font un procès qui a pour issue sa condamnation à mort...','La Passion du Christ',3.2),('Trevor Eve|Julie Christie|Desislava Stef