3.3,'22 juin 2011','Mars Films,Mars Films,Tessalit Productions,SNRT','Le 24 juin 1991, Ghislaine Marchal est retrouvée morte dans la cave de sa villa de Mougins. Des lettres de sang accusent : « Omar m’a tuer ». Quelques jours plus tard, Omar Raddad, son jardinier, est écroué à la prison de Grasse. Il parle peu, comprend mal le français, a la réputation d’être calme et sérieux. Dès lors, il est le coupable évident. Il n’en sortira que 7 ans plus tard, gracié, mais toujours coupable aux yeux de la justice. En 1994, révolté par le verdict, Pierre-Emmanuel Vaugrenard, écrivain convaincu de l’innocence d’Omar Raddad, s’installe à Nice pour mener sa propre enquête et rédiger un ouvrage sur l’affaire…','Omar m\'a tuer',3.7),('Marshall Berenson|Mike O\'Dea|Owen Burke (II)|Denzel Washington|Rhet Kidd|Anastasia Sanidopoulos Mousis|Jessica Kent (II)|George J. Vezina|Debra Garrett|David Harbour|David Meunier|Alex Ziwak|Mark Stefanich|Bill Pullman|Dan Bilzerian|Marton Csokas|Billy \'V\' Vigeant|Chanty Sok|Meredith Prunty|Johnny Skourtis|John Joseph Lindsey|Johnny Messner|E. Roger Mitchell|Chloë Grace Moretz|Haley Bennett|Melissa Leo|Timothy Smith|Vladimir Kulich|William Xifaras|James Wilcox|Tait Fletcher|John Romualdi|Elaine Victoria Grey|Gavin Monteiro|Peter Crafts|Tiffany Crosby|Allen Maldonado|Kristina Mezzetti|Robert Wahlberg|Alex Veadov','Antoine Fuqua',132,315099,182873,'Action|Thriller|Policier','https://fr.web.img3.acsta.net/c_310_420/pictures/14/08/28/16/00/452053.jpg',3.1,'1 octobre 2014','Columbia Pictures,Escape Artists,Village Roadshow Studios,Mace Neufeld Productions,Sony Pictures Releasing France,Lionsgate','Pour McCall, la page était tournée. Il pensait en avoir fini avec son mystérieux passé. Mais lorsqu’il fait la connaissance de Teri, une jeune fille victime de gangsters russes violents, il lui est impossible de ne pas réagir. Sa soif de justice se réveille et il sort de sa retraite pour lui venir en aide. McCall n’a pas oublié ses talents d’autrefois…','Equalizer',3.9),('0','Hayao Miyazaki',123,702835,184989,'Aventure|Animation|Drame','https://fr.web.img6.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/23/10/16/15/34/4707733.jpg',4.2,'1 novembre 2023','Wild Bunch Distribution','Après la disparition de sa mère dans un incendie, Mahito, un jeune garçon de 11 ans, doit quitter Tokyo pour partir vivre à la campagne dans le village où elle a grandi. Il s’installe avec son père dans un vieux manoir situé sur un immense domaine où il rencontre un héron cendré qui devient petit à petit son guide et l’aide au fil de ses découvertes et questionnements à comprendre le monde qui l\'entoure et percer les mystères de la vie.','Le Garçon et le Héron',3.8),('Candice McKoy|Jimmy Palumbo|Michael Lee Laurence|Terry Serpico|James Yaegashi|Frank Pando|Gerry Vichi|Anthony Mackie|Titus Welliver|Afton Williamson|Ed Harris|Felix Solis|Daniel Sauli|Barbara Marineau|J. Smith-Cameron|John Dossett|Kyra Sedgwick|Arthur J. Nascarella|Jonathan Walker (II)|Jabari Gray|Jamie Bell|Ann Arvia|Patrick Collins|Sam Worthington|Mandy Gonzalez|William Sadler|Don Castro|Jason Furlani|Geoffrey Cantor|Robert Clohessy|Erin Quill|Joe Lisi|Elizabeth Banks|Edward Burns|Pooja Kumar|John Solo|J. Bernard Calloway|Genesis Rodriguez|Liz Holtan|James Andrew O\'Conner','Asger Leth',102,156939,185293,'Action|Thriller|Policier','https://fr.web.img3.acsta.net/c_310_420/medias/nmedia/18/86/32/60/19863938.jpg',2.3,'15 février 2012','StudioCanal,Summit Entertainment,Di Bonaventura Pictures','Ancien flic condamné à la prison pour un vol dont il se dit innocent, Nick Cassidy a réussi à s’évader. Dans un célèbre hôtel de New York, il monte jusqu’à l’un des derniers étages et enjambe la fenêtre. Le voilà dehors, sur la corniche, au bord du vide… Lydia Mercer, négociatrice de la police, est chargée d’essayer de le convaincre de ne pas sauter. Plus la jeune femme tente de dénouer cette situation périlleuse, plus elle prend conscience que Cassidy pourrait bien avoir un autre objectif… Son geste a peut-être un rapport avec le mystérieux projet sur lequel travaille son frère. Pendant que l’ex-flic est au bord du vide et attire l’attention de toute la ville, beaucoup de choses se trament et trop de gens semblent s’intéresser à son cas. Les pièces du puzzle vont se révéler peu à peu, au risque de faire tomber beaucoup plus qu’un seul homme…','Dos au mur',3.4),('Pascal Loison|François Legrand|Bertrand Quoniam|Paul Chan|Lio Tipton|Morgan Freeman|Jan Oliver Schroeder|Alexis Jacquin|Paul Lefèvre|Ken Lin|Abel Aboualiten|Christophe Tek|Julien Personnaz|Frédéric Chau|Loïc Brabant|Amr Waked|Cédric Chevalme|Isabelle Cagnat|Alexis Rangheard|Scarlett Johansson|Min-sik Choi|Nicolas Phongpheth|Renaud Cestre|Bob Martet|Mason Lee|Wolfgang Pissors|Julian Rhind-Tutt|Claire Tran|Luca Angeletti|Pilou Asbæk|Feng Hsing|Pierre Gérard','Luc Besson',89,1941424,186452,'Action|Science Fiction','https://fr.web.img4.acsta.net/c_310_420/pictures/14/06/05/09/47/324245.jpg',2.7,'6 août 2014','TF1 Films Production,EuropaCorp Distribution,EuropaCorp Distribution,EuropaCorp','A la suite de circonstances indépendantes de sa volonté, une jeune étudiante voit ses capacités intellectuelles se développer à l’infini. Elle « colonise » son cerveau, et acquiert des pouvoirs illimités.','Lucy',2.9),('Val Kilmer|Peter Mark Kendall|Charles Parnell|Jennifer Connelly|Danny Ramirez|Bashir Salahuddin|Ed Harris|Miles Teller|Jon Hamm|Monica Barbaro|Manny Jacinto|Penelope Kapudija|Jay Ellis|Glen Powell|Lyliana Wray|Tom Cruise|Chelsea Harris|Greg Tarzan Davis|Jean Louisa Kelly|Lewis Pullman','Joseph Kosinski',131,1529608,186636,'Action','https://fr.web.img6.acsta.net/c_310_420/pictures/22/03/29/15/12/0827894.jpg',3.7,'25 mai 2022','Paramount Pictures,Don Simpson/Jerry Bruckheimer Films,Jerry Bruckheimer Films,Paramount Pictures France,Skydance Prods,Tencent Penguin Pictures','Après avoir été l’un des meilleurs pilotes de chasse de la Marine américaine pendant plus de trente ans, Pete “Maverick\" Mitchell continue à repousser ses limites en tant que pilote d\'essai. Il refuse de monter en grade, car cela l’obligerait à renoncer à voler. Il est chargé de former un détachement de jeunes diplômés de l’école Top Gun pour une mission spéciale qu’aucun pilote n\'aurait jamais imaginée. Lors de cette mission, Maverick rencontre le lieutenant Bradley “Rooster” Bradshaw, le fils de son défunt ami, le navigateur Nick “Goose” Bradshaw. Face à un avenir incertain, hanté par ses fantômes, Maverick va devoir affronter ses pires cauchemars au cours d’une mission qui exigera les plus grands des sacrifices.','Top Gun: Maverick',4.3),('Ben Mills|Stephen Horn|Jessica Mance|Lee Fanning|Roy Armstrong|Scarlett Johansson|Dave Acton|Andrew Gorman|Joe Szula|Alison Chand|Michael Moreland|Krystof Hádek|Marius Bincu|Gerry Goodfellow|Paul Brannigan|Oscar Mills|Scott Dymond|May Mewes','Jonathan Glazer',108,48368,187462,'Science Fiction|Thriller|Drama','https://fr.web.img3.acsta.net/c_310_420/pictures/14/05/07/15/58/238222.jpg',4,'25 juin 2014','Ascot Elite Entertainment Group,StudioCanal,Scottish Screen,UK Film Council,Film4,Nick Wechsler Productions,Diaphana Distribution,FilmNation Entertainment,MVP Entertainment,Silver Reel,4DMax,MK2 / Diaphana,MK2 / Diaphana Distribution','Une extraterrestre arrive sur Terre pour séduire des hommes avant de les faire disparaître.','Under the Skin',2.6),('Finn Wittrock|Raymond Mamrak|Arnar Dan|Nolan Gross|Thomas W. Stewart|McKenzie Shea|Ray Winstone|Jennifer Connelly|Leo McHugh Carroll|Gavin Casalegno|Austin Kennedy|Marton Csokas|Lucas McHugh Carroll|Barry Sloane|Joseph G. Quinn|Anne Bergstedt Jordanova|Julian Murdoch|Kevin Durand|Madison Davenport|Sophie Nyweide|Anna Kuchma|Emma Watson|Sami Gayle|Mike McVearry|Skylar Burke|Russell Crowe|Gregg Bello|Ariane Rinehart|Logan Lerman|Don Harvey|Adam Griffith|Dakota Goyo|Anthony Hopkins|Nick Nolte|Jim Ford|Jóhannes Haukur Jóhannesson|Kevin Cannon|Frank Langella|Mark Margolis|Douglas Booth','Darren Aronofsky',138,559723,194938,'Péplum|Aventure|Fantastique','https://fr.web.img4.acsta.net/c_310_420/pictures/14/03/12/18/33/096867.jpg',3,'9 avril 2014','Paramount Pictures,New Regency Pictures,Protozoa Pictures,Paramount Pictures France','Russell Crowe est Noé, un homme promis à un destin exceptionnel alors qu’un déluge apocalyptique va détruire le monde. La fin du monde… n’est que le commencement.','Noé',2.6),('Noah Taylor|Ronnie Kantorik|Dane DeHaan|Eric Mendenhall|Chris McGarry|Gary Oldman|Ron Clinton Smith|Alex Van|Larry Mainland|Guy Pearce|Chance Bartels|Jessica Chastain|Courtney Penny|Mark Ashworth|Tom Proctor|David Fritsch|Toni Byrd|Jacqueline Marie Zwick|Shia LaBeouf|Ryleigh Kantorik|Joel Rogers|Bruce McKinnon|Charles Casey|Jason Clarke|William J. Harrison|Mia Wasikowska|Tom Hardy|Duncan Nicholson|Bill Camp|Trevor Alexander Mann|Ian Mazer|Steve Warren|Lew Temple|Jeff Braun|Ricky Muse|Darryl Booker|J.T. Seidler|Randall Franks','John Hillcoat',115,195628,200399,'Action|Drame|Western','https://fr.web.img4.acsta.net/c_310_420/medias/nmedia/18/90/46/07/20182376.jpg',3.4,'12 septembre 2012','Metropolitan FilmExport,Annapurna Pictures,Pie Films Inc.,Blum Hanson Allen Films','1931. Au cœur de l’Amérique en pleine Prohibition, dans le comté de Franklin en Virginie, état célèbre pour sa production d’alcool de contrebande, les trois frères Bondurant sont des trafiquants notoires : Jack, le plus jeune, ambitieux et impulsif, veut transformer la petite affaire familiale en trafic d’envergure. Il rêve de beaux costumes, d’armes, et espère impressionner la sublime Bertha… Howard, le cadet, est le bagarreur de la famille. Loyal, son bon sens se dissout régulièrement dans l’alcool qu’il ne sait pas refuser… Forrest, l’aîné, fait figure de chef et reste déterminé à protéger sa famille des nouvelles règles qu’impose un nouveau monde économique. Lorsque Maggie débarque fuyant Chicago, il la prend aussi sous sa protection. Seuls contre une police corrompue, une justice arbitraire et des gangsters rivaux, les trois frères écrivent leur légende : une lutte pour rester sur leur propre chemin, au cours de la première grande ruée vers l’or du crime.','Des hommes sans loi',4.1),('0','Lee Unkrich',105,948846,206775,'Famille|Animation|Fantastique','https://fr.web.img6.acsta.net/c_310_420/pictures/17/09/15/12/42/0056825.jpg',4.1,'15 novembre 2017','Pixar Animation Studios,Walt Disney Animation Studios,The Walt Disney Company France,The Walt Disney Company France','Depuis déjà plusieurs générations, la musique est bannie dans la famille de Miguel. Un vrai déchirement pour le jeune garçon dont le rêve ultime est de devenir un musicien aussi accompli que son idole, Ernesto de la Cruz. ','Coco',4.5),('Léa Seydoux|Tilda Swinton|Milton Welsh|Wallance Wolodarsky|Willem Dafoe|F. Murray Abraham|Edward Norton|Bob Balaban|Owen Wilson|Mathieu Amalric|Gabriel Rush|Jason Schwartzman|Florian Lukas|Heike Hanold-Lynch|Fisher Stevens|Ralph Fiennes|Wolfgang Czeczor|Volker Michalowski|Tom Wilkinson|Tony Revolori|Larry Pine|Giselda Volodi|Jeff Goldblum|Adrien Brody|Bill Murray|Harvey Keitel|Waris Ahluwalia|Michaela Caspar|Neal Huff|Jude Law|Saoirse Ronan|Karl Markovics','Wes Anderson',100,405061,207825,'Drame|Comédie','https://fr.web.img3.acsta.net/c_310_420/o_club-allocine-2024-310x420.png_0_se/pictures/14/01/20/12/06/239820.jpg',4.5,'26 février 2014','Twentieth Century Fox France,American Empirical Pictures','Le film retrace les aventures de Gustave H, l’homme aux clés d’or d’un célèbre hôtel européen de l’entre-deux-guerres et du garçon d’étage Zéro Moustafa, son allié le plus fidèle.','The Grand Budapest Hotel',4.2),('Patrick Bonnel|Rachel Khan|Charlotte Rampling|Lucas Prisor|Carole Franck|Frédéric Pierrot|Johan Leysen|Laurent Delbecque|Géraldine Pailhas|Olivier Desautel|Marine Vacth|Jeanne Ruff|Nathalie Richard|Djedje Apali|Gurvan Cloatre|Serge Hefez|Charlotte-Victoire Legrain|Iliana Zabeth|Akéla Sari|Stefano Cassetti','François Ozon',94,279414,209525,'Drame','https://fr.web.img2.acsta.net/c_310_420/pictures/210/059/21005923_2013051510325393.jpg',3.7,'21 août 2013','France 2 Cinéma,Mars Films,Mars Films,Mandarin Cinéma,FOZ','Le portrait d’une jeune fille de 17 ans en 4 saisons et 4 chansons.','Jeune & Jolie',3.3),('0','Pierre Coffin',91,2180461,210493,'Famille|Animation','https://fr.web.img5.acsta.net/c_310_420/pictures/15/06/11/09/20/080813.jpg',3.7,'8 juillet 2015','Universal Pictures International France,Illumination Entertainment','A l\'origine de simples organismes monocellulaires de couleur jaune, les Minions ont évolué au cours des âges au service de maîtres plus abjectes les uns que les autres. Les disparitions répétitives de ceux-ci, des tyrannosaures à Napoléon, ont plongé les Minions dans une profonde dépression. Mais l\'un d\'eux, prénommé Kevin, a une idée. Flanqué de Stuart, l\'adolescent rebelle et de l\'adorable petit Bob, Kevin part à la recherche d\'un nouveau patron malfaisant pour guider les siens. Nos trois Minions se lancent dans un palpitant voyage qui va les conduire à leur nouveau maître : Scarlet Overkill, la première superméchante de l\'histoire. De l\'Antarctique au New York des années 60, nos trois compères arrivent finalement à Londres, où ils vont devoir faire face à la plus terrible menace de leur existence : l\'annihilation de leur espèce.','Les Minions',3.3),('Lorraine Tai|Janine Harouni|Andy Serkis|Bernardo Santos|Vic Waghorn|Max Carver|Peter Sarsgaard|Zoë Kravitz|John Turturro|Philip Shaun McGuinness|Jeffrey Wright|Con O\'Neill|Mark Killeen|Douglas Bunn|Amanda Blake|Amy Clare Beales|Rupert Penry-Jones|Colin Farrell|Juke Hardy (II)|Barry Keoghan|Jayme Lawson|Bharat Mistri|Leemore Marrett Jr.|Paul Dano|Kosha Engler|Alex Ferns|Charlie Carver|Robert Pattinson','Matt Reeves',177,1165588,211012,'Action|Thriller|Policier','https://fr.web.img3.acsta.net/c_310_420/pictures/22/02/16/17/42/3125788.jpg',3.9,'2 mars 2022','Warner Bros.,Warner Bros. France','Deux années à arpenter les rues en tant que Batman et à insuffler la peur chez les criminels ont mené Bruce Wayne au coeur des ténèbres de Gotham City. Avec seulement quelques alliés de confiance - Alfred Pennyworth, le lieutenant James Gordon - parmi le réseau corrompu de fonctionnaires et de personnalités de la ville, le justicier solitaire s\'est imposé comme la seule incarnation de la vengeance parmi ses concitoyens. Lorsqu\'un tueur s\'en prend à l\'élite de Gotham par une série de machinations sadiques, une piste d\'indices cryptiques envoie le plus grand détective du monde sur une enquête dans la pègre, où il rencontre des personnages tels que Selina Kyle, alias Catwoman, Oswald Cobblepot, alias le Pingouin, Carmine Falcone et Edward Nashton, alias l’Homme-Mystère. Alors que les preuves s’accumulent et que l\'ampleur des plans du coupable devient clair, Batman doit forger de nouvelles relations, démasquer le coupable et rétablir un semblant de justice au milieu de l’abus de pouvoir et de corruption sévissant à Gotham City depuis longtemps.','The Batman',4.1),('Pierre Nisse|Nicolas Abraham|Velibor Topic|Sofia Essaïdi|Max Baissette de Malglaive|Nadine Labaki|Léticia Belliccini|Gilles Cohen|Emmanuel Gradi|Laurent Fernandez|Medi Sadoun|Fabien Baïardi|Céline Marchi|Christophe Beudet|Gilles Bellomi|Sacha Petronijevic|Pierre Benoist|Stéphane Blancafort|Vincent Lindon|Eric de Montalier|Eric Bougnon|Gilles Lellouche|Alexis Manenti|Magalie Mateci|Tomi May|Cyril Lecomte','Fred Cavayé',91,226968,212386,'Thriller|Policier','https://fr.web.img6.acsta.net/c_310_420/pictures/13/12/18/12/43/406041.jpg',2.8,'5 février 2014','Gaumont,TF1 Films Production,LGM productions,Gaumont Production,Gaumont Distribution,Nexus Factory,Hatalom,Thibault Grabherr / LGM Cinema,Bad Company,My Melody','Flics sur Toulon, Simon et Franck fêtent la fin d\'une mission. De retour vers chez eux, ils percutent une voiture. Bilan : deux victimes dont un enfant. Franck est indemne. Simon, qui était au volant et alcoolisé, sort grièvement blessé . Il va tout perdre. Sa vie de famille. Son job de flic. Six ans plus tard, divorcé de sa femme Alice, Simon est devenu convoyeur de fonds et peine à tenir son rôle de père auprès de son fils Théo qui a désormais 9 ans. Franck, toujours flic, veille à distance sur lui. Lors d\'une corrida, le petit Théo va être malgré lui le témoin d\'un règlement de compte mafieux. Très vite, il fera l\'objet de menaces. Simon va tout faire pour protéger son fils et retrouver ses poursuivants. Le duo avec Franck va au même moment se recomposer. Mais ce sera aussi pour eux l\'occasion de revenir sur les zones d\'ombre de leur passé commun. ','Mea Culpa',3.3),('Naomi Ackie|Andy Serkis|Richard Bremmer|Lupita Nyong\'o|Daisy Ridley|Alison Rose|Tanya Moodie|Shirley Henderson|Robin Guiver|Keri Russell|Oscar Isaac|Lin-Manuel Miranda|Amir El-Masry|Domhnall Gleeson|Paul Kasey|Anthony Daniels|Richard E. Grant|Geff Francis|Mandeep Dhillon|Amanda Hale|Jodie Comer|Kelly Marie Tran|Carrie Fisher|Billy Dee Williams|Brian Herring|Simon Paisley Day|Harrison Ford|Billy Howle|Joonas Suotamo|John Boyega|Nasser Memarzia|Denis Lawson|Greg Grunberg|Adam Driver|Mark Hamill|Billie Lourd|Dominic Monaghan|Dave Chapman|Amanda Lawrence|Ian McDiarmid','J.J. Abrams',142,2420710,215094,'Science Fiction|Aventure','https://fr.web.img5.acsta.net/c_310_420/pictures/20/10/02/12/21/3764004.png',3.1,'18 décembre 2019','Walt Disney Pictures,Lucasfilm Ltd.,Bad Robot,The Walt Disney Company France','La conclusion de la saga Skywalker. De nouvelles légendes vont naître dans cette bataille épique pour la liberté.','Star Wars: L\'Ascension de Skywalker',3),('Raymond Mamrak|Andy Serkis|Lupita Nyong\'o|Daisy Ridley|Simon Pegg|Mark Stanley|Yayan Ruhian|Oscar Isaac|Domhnall Gleeson|Miltos Yerolemou|Mark Preston|Gwendoline Christie|Phoenix James|Johnny Lynch|Anthony Daniels|Pip Andersen|Max von Sydow|Ken Leung|Iko Uwais|Morgan Dameron|Dante Briggins|Mike Quinn|Michael Giacchino|Dixie Arnold|Kenny Baker|Carrie Fisher|Warwick Davis|Ha