ido|Ramona Kunze-Libnow|Dave Wong|Callum Turner|Valerie Pachner|Jacqueline Boatswain|Lucas Englander|Ezra Miller|Victoria Yeates|William Nadylam|Paul Low-Hang|Peter Simonischek|Jude Law|Oliver Masucci|Stefan Race|Dónal Finn|Maja Bloom','David Yates',142,1132062,228087,'Aventure|Fantastique','https://fr.web.img6.acsta.net/c_310_420/pictures/22/03/16/15/20/0170262.jpg',2.9,'13 avril 2022','Warner Bros.,Warner Bros. France,Heyday Films','Le professeur Albus Dumbledore sait que le puissant mage noir Gellert Grindelwald cherche à prendre le contrôle du monde des sorciers. Incapable de l’empêcher d’agir seul, il sollicite le magizoologiste Norbert Dragonneau pour qu’il réunisse des sorciers, des sorcières et un boulanger moldu au sein d’une équipe intrépide. Leur mission des plus périlleuses les amènera à affronter des animaux, anciens et nouveaux, et les disciples de plus en plus nombreux de Grindelwald. Pourtant, dès lors que que les enjeux sont aussi élevés, Dumbledore pourra-t-il encore rester longtemps dans l’ombre ?','Les Animaux Fantastiques : les Secrets de Dumbledore',3.1),('Matthew John Morley|Sam Claflin|Richard Goulding|Stephen Peacocke|Janet McTeer|Brendan Coyle|Manuel Severi|Ben Lloyd-Hughes|Sophie Stanton|Chuku Modu|Matthew Lewis|Jenna Coleman|Sharon Cherry Ballard|Pablo Raybould|Joanna Lumley|Samantha Spiro|Elizabeth Croft|Vanessa Kirby|Charles Dance|Muzz Khan|Verity Marshall|Stephen Chance|Emilia Clarke|Lily Travers','Thea Sharrock',110,39325,230327,'Drame|Romance','https://fr.web.img4.acsta.net/c_310_420/pictures/16/05/02/17/27/063880.jpg',2.9,'22 juin 2016','Amazon MGM,New Line Cinema,Warner Bros. France','Une charmante petite ville de l\'Angleterre rurale. Si elle est originale et artiste dans l\'âme, Louisa \"Lou\" Clark, 26 ans, n\'a aucune ambition particulière. Elle se contente d\'enchaîner les boulots pour permettre à ses proches de joindre les deux bouts.','Avant toi',4.1),('Ben VanderMey|Lily James|Flea|Lanny Joon|Jon Hamm|Ansel Elgort|R. Marcos