0/01/14/09/12/0418204.jpg',3,'29 janvier 2020','Warner Bros. France,Broad Green Pictures,Gil Netter Productions','Le combat historique du jeune avocat Bryan Stevenson.  Après ses études à l’université de Harvard, Bryan Stevenson aurait pu se lancer dans une carrière des plus lucratives. Il décide pourtant de se rendre en Alabama pour défendre ceux qui ont été condamnés à tort, avec le soutien d’une militante locale, Eva Ansley. Un de ses premiers cas - le plus incendiaire - est celui de Walter McMillian qui, en 1987, est condamné à mort pour le meurtre retentissant d’une jeune fille de 18 ans. Et ce en dépit d’un grand nombre de preuves attestant de son innocence et d’un unique témoignage à son encontre provenant d’un criminel aux motivations douteuses. Au fil des années, Bryan se retrouve empêtré dans un imbroglio de manœuvres juridiques et politiques. Il doit aussi faire face à un racisme manifeste et intransigeant alors qu’il se bat pour Walter et d’autres comme lui au sein d’un système hostile.','La Voie de la justice',4.1),('James McAvoy|Roy Wilson|Brad William Henke|Rosemary Howard|Haley Lu Richardson|Roy James Wilson|Bruce Willis|Jessica Sula|Christopher Lee Philips|Sebastian Arcelus|Barbara Edwards|Betty Buckley|Santiago Michel|Peter Patrikios|Kate Jacoby|Nakia Dillard|Julie Potter|Kash Goins|Junnie Lopez|Steven Dennis|Andrea Havens|Ameerah Briggs|Anya Taylor-Joy|Jerome Gallman|Robert Michael Kelly|Izzie Coffey|Kim Director|Jon Douglas Rainey|Dann Fink|Neal Huff|Ukee Washington|Kelly Werkheiser','M. Night Shyamalan',117,594427,240516,'Epouvante-horreur|Fantastique|Thriller','https://fr.web.img5.acsta.net/c_310_420/pictures/16/12/09/09/51/046535.jpg',3.7,'22 février 2017','Blumhouse Productions,Blinding Edge Pictures,Universal Pictures International France','Kevin a déjà révélé 23 personnalités, avec des attributs physiques différents pour chacune, à sa psychiatre dévouée, la docteure Fletcher, mais l’une d’elles reste enfouie au plus profond de lui. Elle va 