l, dans le film WONKA. Timothée Chalamet incarne ce jeune homme débordant d’idées et déterminé à changer le monde… avec gourmandise ! Cette œuvre haute en couleur, mêlant émotion et humour, prouve que, dans la vie, les rêves peuvent devenir réalité – surtout si on a la chance de rencontrer Willy Wonka.','Wonka',3.7),('Nassim Lyes|Philippe Houillez|Yasin Houicha|Fahmi Guerbâa|Paulette Joly|Brandon Omekenge|Zohra Benali|Nozha Khouadra|Damien Zanoly|Arnaud Allain|Florent Hill|Claude Perron|Camélia Jordana|Jean-Baptiste Lafarge|Guillaume Duhesme|Virgil Leclaire|Jean-Luc Olivier|Nicolas Vaude|Eddy Suiveng|Daniel Auteuil|Abderahmane Cherif|Xavier Guelfi','Yvan Attal',97,412414,251711,'Drame|Comédie','https://fr.web.img5.acsta.net/c_310_420/pictures/17/09/25/10/41/2444205.jpg',3.5,'22 novembre 2017','France 2 Cinéma,Pathé,Pathé,Chapter 2,Nexus Factory,UMedia,Moonshaker,CN6 Productions,My Melody','Neïla Salah a grandi à Créteil et rêve de devenir avocate. Inscrite à la grande université parisienne d’Assas, elle se confronte dès le premier jour à Pierre Mazard, professeur connu pour ses provocations et ses dérapages. Pour se racheter une conduite, ce dernier accepte de préparer Neïla au prestigieux concours d’éloquence. A la fois cynique et exigeant, Pierre pourrait devenir le mentor dont elle a besoin… Encore faut-il qu’ils parviennent tous les deux à dépasser leurs préjugés.','Le Brio',3.8),('July Messean|Marc Fraize|Michel Hazanavicius|Laurent Nicolas (II)|Pedro Winter|Jacky Lambert|Grégoire Ludig|Vincent Grass|Anaïs Demoustier|Philippe Duquesne|Orelsan|Jeanne Rosa|Benoît Poelvoorde','Quentin Dupieux',71,95929,252378,'Comédie','https://fr.web.img4.acsta.net/c_310_420/pictures/18/05/09/17/07/4888503.jpg',3.7,'4 juillet 2018','Cinéfrance,UMedia,Diaphana Distribution,Atelier de Production','Un poste de police. Un tête-à-tête, en garde à vue, entre un commissaire et son suspect.','Au Poste!',3.2),('Michael Stuhlbarg|Marco Sgrosso|Esther Garrel|Vanda Capriolo|Armie Hammer|Andr