ée par une usine du puissant groupe chimique DuPont, premier employeur de la région. Afin de faire éclater la vérité sur la pollution mortelle due aux rejets toxiques de l’usine, il va risquer sa carrière, sa famille, et même sa propre vie...','Dark Waters',4.1),('Elisabeth Moss|Léa Seydoux|Tilda Swinton|Henry Winkler|Cécile de France|Morgane Polanski|Wallance Wolodarsky|Willem Dafoe|Edward Norton|Bob Balaban|Owen Wilson|Mathieu Amalric|Hippolyte Girardot|Mohamed Belhadjine|Christoph Waltz|Jason Schwartzman|Timothée Chalamet|Fisher Stevens|Jeffrey Wright|Denis Ménochet|Lois Smith|Tony Revolori|Frances McDormand|Antonia Desplat|Toheeb Jimoh|Griffin Dunne|Anjelica Bette Fellini|Lyna Khoudri|Rupert Friend|Adrien Brody|Benicio Del Toro|Alex Lawther|Bill Murray|Benjamin Lavernhe|Liev Schreiber|Steve Park|Saoirse Ronan|Guillaume Gallienne|Félix Moati|Sam Haygarth','Wes Anderson',108,197450,269684,'Drame|Comédie|Romance','https://fr.web.img5.acsta.net/c_310_420/pictures/21/07/05/10/50/4043397.jpg',3.5,'27 octobre 2021','Searchlight Pictures,American Empirical Pictures,The Walt Disney Company France,Indian Paintbrush',' met en scène un recueil d’histoires tirées du dernier numéro d’un magazine américain publié dans une ville française fictive du 20e siècle.','The French Dispatch',3.3),('0','Patrick Imbert',95,49532,269946,'Aventure|Animation|Drame','https://fr.web.img2.acsta.net/c_310_420/pictures/21/07/29/17/38/3976490.jpg',4.2,'22 septembre 2021','Goodfellas,France 3 Cinéma,Mélusine Productions,Wild Bunch Distribution,Auvergne Rhône-Alpes Cinéma,Folivari,Julianne Films','A Katmandou, le reporter japonais Fukamachi croit reconnaître Habu Jôji, cet alpiniste que l\'on pensait disparu depuis des années. Il semble tenir entre ses mains un appareil photo qui pourrait changer l’histoire de l’alpinisme. Et si George Mallory et Andrew Irvine étaient les premiers hommes à avoir atteint le sommet de l’Everest, le 8 juin 1924 ? Seul le petit Kodak Vest Pocket avec lequel ils devaient se photographier sur le toit du monde pourrait livrer la vérité. 70 ans plus tard, pour tenter de résoudre ce mystère, Fukamachi se lance sur les traces de Habu. Il découvre un monde de passionnés assoiffés de conquêtes impossibles et décide de l’accompagner jusqu’au voyage ultime vers le sommet des dieux.','Le Sommet des Dieux',4.3),('Dolph Lundgren|Nicole Kidman|Patrick Wilson|Temuera Morrison|Jason Momoa|Vincent Regan|Yahya Abdul-Mateen II|Amber Heard|Ricardo Molina|Grant Huggair|Pilou Asbæk|Indya Moore|Randall Park','James Wan',124,552105,270235,'Action|Aventure|Fantastique','https://fr.web.img3.acsta.net/c_310_420/pictures/23/12/14/16/49/3331945.jpg',1.7,'20 décembre 2023','Warner Bros.,Warner Bros. France,The Safran Company,DC Entertainment,Atomic Monster','Black Manta, toujours hanté par le désir de venger son père, est maintenant plus puissant que jamais avec le légendaire Trident Noir entre ses mains. Pour l’anéantir, Aquaman doit s’associer à son frère Orm ancien roi d’Atlantide et actuellement emprisonné. Ensemble, ils devront surmonter leurs différences pour protéger leur royaume et sauver le monde d’une destruction irréversible.','Aquaman et le Royaume perdu',2.5),('Mojean Aria|Han Soto|Javier Molina|Myles Humphus|Rey Hernandez|Daniel Wu|Gabrielle Echols|Rebecca Ferguson|Thandiwe Newton|Angela Sarafyan|Cliff Curtis|Thomas Francis Murphy|Tracy Brotherton|Roxton Garcia|Demián Castro|Ivan Mbakop|René Mena|Shawn Carter Peterson|Andrew Masset|Jules Hartley|Hugh Jackman|Natalie Martinez|Jessica Medina|Brett Cullen|Giovannie Cruz|Sue-Lynn Ansari|Norio Nishimura|Nico Parker|Sam Medina|Marina de Tavira|Teri Wyble','Lisa Joy',116,99007,271387,'Science Fiction|Thriller|Romance','https://fr.web.img3.acsta.net/c_310_420/pictures/21/07/28/10/29/3991427.jpg',3,'25 août 2021','Warner Bros.,Warner Bros. France,Michael De Luca Productions,FilmNation Entertainment,Kilter Film','Dans un futur proche, Miami a été submergé par les flots, suite aux effets du changement climatique. Un enquêteur privé, Nick Bannister, est engagé par des clients afin de retrouver leurs précieux souvenirs. Au cours de sa dernière affaire, il tombe éperdument amoureux de sa cliente. A sa disparition, le détective est désemparé et se lance à sa recherche. Il se retrouve alors perdu dans une boucle temporelle et découvre des aspects de sa personnalité qu\'il ne connaissait pas auparavant.','Reminiscence',2.8),('Paul Adelstein|Mark St. Cyr|Brandon Herron|Hong Chau|Reed Birney|Janet McTeer|Peter Grosz|Anya Taylor-Joy|Arturo Castro (XII)|Rebecca Koon|Aimee Carrero|Christina Brucato|Judith Light|Adam Aalderks|Nicholas Hoult|Ralph Fiennes|Rob Yang|John Leguizamo','Mark Mylod',108,124279,271676,'Thriller','https://fr.web.img6.acsta.net/c_310_420/pictures/22/10/12/12/20/5889028.jpg',2.8,'23 novembre 2022','Gary Sanchez Productions,The Walt Disney Company France,Hyperobject Industries,Searchlight','Un couple se rend sur une île isolée pour dîner dans un des restaurants les plus en vogue du moment, en compagnie d’autres invités triés sur le volet. Le savoureux menu concocté par le chef va leur réserver des surprises aussi étonnantes que radicales...','Le Menu',3.3),('Jackie Berroyer|Cordelia Lange|Armndo Bismuth|Zohar Wexler|Edme Bismuth|Alona Nahmias|Itay Ben Ami|Alexander Aviram|Valeria Bruni Tedeschi|Menahem Lang|Shiraz Tsarfat|Yoel Rozenkier|Aviv Telem|Yona Rozenkier|Fantine Gelu|Mai Weisz|Uri Falk|Marguerite Margeaux Lampley|Alma Aviram','Yossi Aviram',101,5019,271839,'Drame','https://fr.web.img2.acsta.net/c_310_420/pictures/24/01/25/09/04/2620263.jpg',2.8,'28 février 2024','Les Films du Losange,Les Films du Poisson,24 Images,Gum Films,Gum Films','À Tel Aviv, Ori croise par hasard Anna, une écrivaine française, lors du procès d’un ancien Nazi. Il est bouleversé de reconnaître cette femme dont le souvenir le hante depuis qu’ils se sont follement aimés à Turin, 20 ans plus tôt. Mais Anna soutient qu\'ils ne se sont jamais rencontrés. Peut-être qu’au milieu du dése