iem». Une existence sans attaches, en forme de fuite en avant, qui la comble en apparence. Alors que la pression de sa compagnie redouble, Cassandre finit par perdre pied. Saura-t-elle affronter les douleurs enfouies et revenir vers ceux qu\'elle a laissés au sol ?','Rien à foutre',2.9),('Léa Seydoux|Hopi Grace|Hamza Baissa|Huw Novelli|Stellan Skarsgård|Charlotte Rampling|Amer El-Erwadi|Rebecca Ferguson|Babs Olusanmokun|Florence Pugh|Remi Fadare|Alison Halstead|Giusi Merli|Havin Fathi|Timothée Chalamet|Javier Bardem|Imola Gaspar|Stephen McKinley Henderson|Dave Bautista|Austin Butler|Omar Elbooz|Cat Simmons|Abdelkarim Hussein Seli Mohamed|Zendaya|Souheila Yacoub|Anya Taylor-Joy|Hassanin|Alison Adnet|Jasper Ryan-Cater|Kait Tenison|Laura Mizere|Christopher Walken|Hassan Najib|Josh Brolin|Serhat Metin|Tara Breathnach|Amra Mallassi|Moe Bar-El|Joseph Beddelem|Roger Yuan','Denis Villeneuve',166,1383999,278742,'Science Fiction|Drame','https://fr.web.img2.acsta.net/c_310_420/pictures/24/01/26/10/18/5392835.jpg',4.2,'28 février 2024','Warner Bros. France,Legendary Pictures,Warner Bros. Pictures,Warner Bros. Pictures','Dans DUNE : DEUXIÈME PARTIE, Paul Atreides s’unit à Chani et aux Fremen pour mener la révolte contre ceux qui ont anéanti sa famille. Hanté par de sombres prémonitions, il se trouve confronté au plus grand des dilemmes : choisir entre l’amour de sa vie et le destin de l’univers.','Dune : Deuxième Partie',4.5),('Stéphane Mercoyrol|Cif Eddine Gadra|Margot Ringard Oldra|Djibril Galy|Léo Maindron|Christian Starr Lassen|Anne See|Josse Capet|Sébastien Depommier|Romain Francisco|Evelyne Tardy|Vincent Sornaga|Bluenn Salaun|Vincent Lacoste|Virginie Tardy|Suzanne de Baecque|Marine Veirun|Marc Brunet|Maud Léone|Alice Piatier|Simon Rérolle|Eugène Marcuse|Maxime De Toledo|Michel Masiero|Pierre Ngongang|Mounia Raoui|Paul Beaurepaire|Adrien Casse|Emmanuel Bellet|Thibault Maunoury|Vincent Schmitt|Anaïs Demoustier|Bertrand Bossard|Cyril Durel|Emmanuelle N\'Zuzi','Katell Quillévé