rale rencontre dans un bar d’hôtel un voyageur anglais. Il lui semble être l’homme rêvé pour l’aider à fuir le pays. Elle réalise trop tard qu’au contraire, elle entre à ses côtés dans un monde plus trouble, plus dangereux.','Stars At Noon',2.1),('Andranic Manet|Martine Chevallier|Adam Pouilhe|Laurent Poitrenaux|Alexandre Marchesseau|Lucie Vadot|Catherine Lefroid|Louise Bourgoin','Thomas Salvador',112,39384,283583,'Fantastique|Drame','https://fr.web.img5.acsta.net/c_310_420/pictures/23/02/01/16/28/5510102.jpg',3.9,'1 février 2023','Le Pacte,Le Pacte,Christmas In July,Indie Sales,Auvergne-Rhône-Alpes Cinéma','Pierre, ingénieur parisien, se rend dans les Alpes pour son travail. Irrésistiblement attiré par les montagnes, il s’installe un bivouac en altitude et décide de ne plus redescendre. Là-haut, il fait la rencontre de Léa et découvre de mystérieuses lueurs.','La Montagne',2.8),('Patti LuPone|Stephanie Herrera|Tristan D. Lalla|Kwasi Songui|Théodore Pellerin|Luis Oliva|Tyrone Benskin|Sylvain Landry|Kylie Rogers|Karl Roy|Catherine Bérubé|Amy Ryan|Maev Beaty|Bill Hader|Emmanuel Schwartz|Mike Taylor (II)|Armen Nahapetian|Denis Ménochet|Michael Esper|Julia Antonelli|Stephen McKinley Henderson|Arthur Holden|Patrick Kwok-Choon|Lily Bird|Ryan S. Hill|Richard Kind|Joaquin Phoenix|Michael Gandolfini|Hayley Squires|François Paquette|Parker Posey|Catherine Lemieux|Alex Bisping|Manuel Tadros|Archie Madekwe|Zoe Lister-Jones|Nathan Lane|Peter Seaborn|Bradley Fisher|Julian Richings','Ari Aster',179,35019,283915,'Aventure|Drame|Comédie','https://fr.web.img4.acsta.net/c_310_420/pictures/23/04/05/11/32/2503739.jpg',3.6,'26 avril 2023','ARP Sélection,Square Peg TV,A24,Access Industries,IPR.VC','Beau tente désespérément de rejoindre sa mère. Mais l’univers semble se liguer contre lui…','Beau Is Afraid',3.2),('Zoé Bruneau|Frédérique Bardakoff|Thibault Vinçon|Eric Feldman (II)|Laurent Poitrenaux|Ophelia Kolb|Calixte Broisin-Doutaz|Mohammed Sadi|Noée Abita|Charlotte Gainsbourg|Didier Sandre|Adrien Colliard|Calypso Buijtenhuijs|Megan Northam|Raphaël Thiéry|Heza Botto|Emmanuelle Béart|Mounir Margoum|Lilith Grasmug','Mikhaël Hers',111,78880,284676,'Drame','https://fr.web.img5.acsta.net/c_310_420/pictures/22/04/12/16/01/3361793.jpg',4,'4 mai 2022','Nord-Ouest Films,Pyramide Distribution,Arte France Cinéma,MK2 International','Paris, années 80. Elisabeth vient d’être quittée par son mari et doit assurer le quotidien de ses deux adolescents, Matthias et Judith. Elle trouve un emploi dans une émission de radio de nuit, où elle fait la connaissance de Talulah, jeune fille désœuvrée qu’elle prend sous son aile. Talulah découvre la chaleur d’un foyer et Matthias la possibilité d’un premier amour, tandis qu’Elisabeth invente son chemin, pour la première fois peut-être. Tous s’aiment, se débattent... leur vie recommencée ?','Les Passagers de la nuit',3.8),('Andrea Muñoz|Jim Garrity|Waymond Lee|Aaron Taylor-Johnson|Andrew Koji|Brad Pitt|Sandra Bullock|Emelina Adams|Tania Verafield|Harrison Xu|Brian Tyree Henry|Mike Ferguson|Julio Gabay|Johanna Watts|Pasha D. Lychnikoff|Karen Fukuhara|Bad Bunny|Masi Oka|Riria|Jason Matthew Smith|Hiroyuki Sanada|Yoshi Sudarso|Zooey Miyoshi|Naomi Matsuda|Logan Lerman|Joey King|Michael Shannon|Zazie Beetz','David Leitch',127,491067,284846,'Action|Thriller','https://fr.web.img6.acsta.net/c_310_420/pictures/22/07/13/11/36/3514892.jpg',3.2,'3 août 2022','Sony Pictures,Sony Pictures,CTB,Sony Pictures Releasing France,Fuqua Films,87North','Coccinelle est un assassin malchanceux et particulièrement déterminé à accomplir sa nouvelle mission paisiblement après que trop d\'entre elles aient déraillé. Mais le destin en a décidé autrement et l\'embarque dans le train le plus rapide au monde aux côtés d\'adversaires redoutables qui ont tous un point commun, mais dont les intérêts divergent radicalement... Il doit alors tenter par tous les moyens de descendre du train.','Bullet Train',3.9),('Joniece Jamison|Emmanuelle Devos|Jeanne Balibar|Max Har