d|Renata Vaca|Michael Beach|Paulette Hernandez|Tobin Bell|Donagh Gordon|Synnøve Macody Lund|Costas Mandylor|Isan Beomhyun Lee|Jorge Briseño|Octavio Hinojosa|Lucía Gómez-Robledo','Kevin Greutert',118,315046,291879,'Epouvante-horreur','https://fr.web.img6.acsta.net/c_310_420/pictures/23/07/27/18/03/4072864.jpg',2.7,'25 octobre 2023','Metropolitan FilmExport,Twisted Pictures,Lionsgate,Atomic Monster','John Kramer, le tueur au puzzle, est de retour dans le volet le plus perturbant de la franchise SAW. Les événements se situent entre SAW I et II, on y retrouve un John, malade et désespéré, qui se rend au Mexique afin de subir une opération expérimentale capable de guérir son cancer, mais il découvre que tout ceci n’est qu’une escroquerie visant des malades vulnérables et affligés. Animé d\'un nouveau but, le célèbre tueur en série retourne à son œuvre, et va prendre sa revanche sur ces escrocs dans un terrible « jeu » dont il a le secret, à travers des pièges toujours plus machiavéliques et ingénieux les uns que les autres.','Saw X',3.2),('Romain Fleury|Diane Kruger|Mathieu Kassovitz|Grégory Fitoussi|Amira Casar|Elodie Navarre|Marta Nieto|Aleksandra Yermak|Adrien Malvoisin','Yann Gozlan',123,100349,292377,'Thriller','https://fr.web.img3.acsta.net/c_310_420/pictures/23/08/01/13/52/4599315.jpg',3,'6 septembre 2023','France 2 Cinéma,SND,SND,SND,2425 Production,Orange Studio,Canal +,Anga Productions,Eagles team entertainment','Pilote de ligne confirmée, Estelle mène, entre deux vols long-courriers, une vie parfaite avec Guillaume, son mari aimant et protecteur. Un jour, par hasard, dans un couloir d’aéroport, elle recroise la route d’Ana, photographe avec qui elle a eu une aventure passionnée vingt ans plus tôt. Estelle est alors loin d’imaginer que ces retrouvailles vont l’entraîner dans une spirale cauchemardesque et faire basculer sa vie dans l’irrationnel…','Visions',2.6),('Théo Askolovitch|Mamadou Minté|Sandor Funtek|Garance Marillier|Sawsan Abès|Luiza Benaïssa|Slimane 