Jour2fête,Inicia Films','Cocó, huit ans, a bien du mal à savoir qui elle est. Au cours d’un été passé parmi les ruches du Pays Basque, elle éveille sa singularité au sein des femmes de sa famille, elles-mêmes en proie au doute. Dans un monde où il existe 20 000 espèces d’abeilles différentes, il existe forcément une identité qui corresponde à Cocó…','20 000 espèces d\'abeilles',3.6),('Romain Parent|Arieh Worthalter|Ambroise Sabbagh|Christian Mazzuchini|Priscilla Lopes|Chloé Lecerf|Maxime Tshibangu|Jerzy Radziwilowicz|Arthur Verret|Ulysse Dutilloy-Liégeois|Lucas Olmedo|Arthur Harari|François Favrat|Stéphan Guérin-Tillié|Nicolas Briançon|Prescillia Martin|Aurélien Chaussade|Jeremy Lewin|Paul Jeanson|Didier Borga|Laetitia Masson|Xavier Aubert','Cédric Kahn',116,110011,299937,'Judiciaire|Policier|Historique|Drame','https://fr.web.img6.acsta.net/c_310_420/pictures/23/06/27/12/21/2686698.jpg',4.5,'27 septembre 2023','Ad Vitam,Moonshaker,Charades,Tropdebonheur Productions,Tropdebonheur Productions','En avril 1976, débute le deuxième procès de Pierre Goldman, militant d’extrême gauche, condamné en première instance à la réclusion criminelle à perpétuité pour quatre braquages à main armée, dont un ayant entraîné la mort de deux pharmaciennes. Il clame son innocence dans cette dernière affaire et devient en quelques semaines l’icône de la gauche intellectuelle. Georges Kiejman, jeune avocat, assure sa défense. Mais très vite, leurs rapports se tendent. Goldman, insaisissable et provocateur, risque la peine capitale et rend l’issue du procès incertaine.','Le Procès Goldman',4),('Moritz Runzi|Denis Podalydès|Damien Rondeau|Ambroise Sabbagh|François Philippi|Romaric Thomas|Stéphanie Bailly|Orlando Vauthier|Karim Seghair|Aurélie Delvenne|Stefan Crepon|Valérie Donzelli|Thaïs Vauquières|Sabrina Seyvecou|Riad Gahmi|Salomé Doux|Milan Hatala|Jonathan Cohen|Antoine Berry-Roger|Arnaud Pilarczyk|Maurice Joao Baty|Souheila Yacoub|Côme Levin|Melan Omerta|Matilda Kime|Alioune Sané|Rachid Bouzid|Alma Galy Nadal|David Olivier Fischer|Emmanuelle Bercot|Thomas Silberstein|Xavier Beauvois|Alice Cambournac|Emilia Derou-Bernal|Johanna Colbock','Cédric Kahn',114,88397,300484,'Comédie','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/08/09/30/4432840.jpg',3.7,'10 janvier 2024','France 2 Cinéma,Ad Vitam,UMedia,Elle Driver,Curiosa Films,Tropdebonheur Productions,My Melody','Simon, réalisateur aguerri, débute le tournage d’un film racontant le combat d’ouvriers pour sauver leur usine. Mais entre les magouilles de son producteur, des acteurs incontrôlables et des techniciens à cran, il est vite dépassé par les événements. Abandonné par ses financiers, Simon doit affronter un conflit social avec sa propre équipe. Dans ce tournage infernal, son seul allié est le jeune figurant à qui il a confié la réalisation du making of.','Making Of',3.3),('Nina Meurisse|Mathieu Perotto|Fabien Giameluca|Younès Boucif|Alexis Manenti|Hafsia Herzi','Iris Kaltenbäck',97,29163,302951,'Drame','https://fr.web.img6.acsta.net/c_310_420/pictures/23/08/31/16/29/0547250.jpg',3.9,'11 octobre 2023','Mact Productions,Marianne productions,Diaphana Distribution,JPG Films,Be For Films','Comment la vie de Lydia, sage-femme très investie dans son travail, a-t-elle déraillé ? Est-ce sa rupture amoureuse, la grossesse de sa meilleure amie Salomé, ou la rencontre de Milos, un possible nouvel amour ? Lydia s’enferme dans une spirale de mensonges et leur vie à tous bascule....','Le Ravissement',4),('Philippe Torreton|Arthur Guivarch|Jean-Hugues Anglade|Marc Riso|Bruno Sanches|Thomas Solivérès|Amir El Kacem|Diego Martín|Samuel Le Bihan','Mathieu Turi',103,33469,304537,'Aventure|Fantastique','https://fr.web.img6.acsta.net/c_310_420/pictures/23/10/10/10/41/5993062.jpg',2.9,'15 novembre 2023','Kinology,Alba Films,Alba Films,Full Time Studio,Marcel Films','1956, dans le nord de la France. Une bande de mineurs de fond se voit obligée de conduire un professeur faire des prélèvements à mille mètres sous terre. Après un éboulement qui les empêche de remonter, ils découvrent une crypte d’un autre temps, et réveillent sans le savoir quelque chose qui aurait dû rester endormi.','Gueules noires',2.6),('Olivia Colman|Richard Goulding|Malachi Kirby|Alisha Weir|Eileen Atkins|Lolly Adefope|Timothy Spall|Hugh Skinner|Anjana Vasan|Paul Chahidi|Gemma Jones|Jason Watkins|Joanna Scanlan|Jessie Buckley','Thea Sharrock',100,51921,304573,'Policier|Comédie|Drame','https://fr.web.img5.acsta.net/c_310_420/pictures/24/01/30/11/42/4484085.jpg',3.3,'13 mars 2024','StudioCanal,StudioCanal,StudioCanal,Blueprint Pictures,Film4','Littlehampton, 1920. Lorsque Edith Swan commence à recevoir des lettres anonymes truffées d\'injures, Rose Gooding, sa voisine irlandaise à l’esprit libre et au langage fleuri, est rapidement accusée des crimes. Toute la petite ville, concernée par cette affaire, s’en mêle. L\'officière de police Gladys Moss, rapidement suivie par les femmes de la ville, mène alors sa propre enquête : elles soupçonnent que quelque chose cloche et que Rose pourrait ne pas être la véritable coupable, victime des mœurs abusives de son époque...','Scandaleusement vôtre',3.7),('Maxie Peters|Andy Dawson|Arthur Oxley|Jen Patterson|Reuben Bainbridge|Trevor Fox|Laura Lee Daly|Chris Gotts|Andrea Johnson|Joe Armstrong|Debbie Honeywood','Ken Loach',113,96295,304576,'Drame','https://fr.web.img4.acsta.net/c_310_420/pictures/23/09/20/09/08/2713358.jpg',3.3,'25 octobre 2023','Why Not Productions,Goodfellas,Sixteen Films,StudioCanal UK,Le Pacte','TJ Ballantyne est le propriétaire du \"Old Oak\", un pub situé dans une petite bourgade du nord de l’Angleterre. Il y sert quotidiennement les mêmes habitués désœuvrés pour qui l’endroit est devenu le dernier lieu où se retrouver. L’arrivée de réfugiés syriens va créer des tensions dans le village. TJ va cependant se lier d’amitié avec Yara, une jeune migrante passionnée par la photographie. Ensemble, ils vont tenter de redonner vie à la communauté locale en