t Hammond|Harris Dickinson|Kevin Anton|Cazzey Louis Cereghino|Jullian Dulce Vida|Scott Innes|Sam Franich|Holt McCallany|Michael Harney|Chavo Guerrero Jr.|Michael Papajohn','Sean Durkin',133,46627,305544,'Biopic|Drame','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/22/17/09/3537863.jpg',3.9,'24 janvier 2024','Metropolitan FilmExport,BBC Films,A24,House Productions','Les inséparables frères Von Erich ont marqué l’histoire du catch professionnel du début des années 80. Entrainés de main de fer par un père tyrannique, ils vont devoir se battre sur le ring et dans leur vie. Entre triomphes et tragédies, cette nouvelle pépite produite par A24 est inspirée de leur propre histoire.','Iron Claw',4.1),('Franck Assi|Nigel Fairs|Tom Murphy','Matt Carter (II)',134,1753,305756,'Drame|Romance','https://fr.web.img6.acsta.net/c_310_420/pictures/24/02/07/09/23/0863240.jpg',3.5,'28 février 2024','Optimale Distribution,Take A Seat Pictures','Les tensions sont vives dans un club de rugby Londonien : l’équipe est à court d’argent et divisée. C’est dans ce contexte électrique que lors d’une soirée arrosée, Mark, une nouvelle recrue, couche avec Warren, un de ses coéquipiers les plus populaires. Le hic, c’est qu’ils sont tous les deux déjà en couple. Les deux hommes doivent dissimuler leurs sentiments grandissants en conciliant leurs propres vulnérabilités et les démonstrations de machisme sur le terrain. Ou risquer de détruire le club qu’ils affectionnent.','Dans la mêlée',0),('Amadu Djau|Jonathan Demurger|Albane Ducros|Denis Podalydès|Aminata Salay Adamou|Lisandru Savelli|Antoine Ducros|Aïssatou Diallo Sagna|Timothée Darmet|Cédric Appietto|Nadia Moussa|Suzy Bemba|Paul Garatte|Estelle Lescure|Virginie Ledoyen|Jean Michelangeli','Catherine Corsini',107,22450,306156,'Drame','https://fr.web.img6.acsta.net/c_310_420/pictures/23/06/12/15/24/2366267.jpg',3,'12 juillet 2023','France 3 Cinéma,Playtime,Le Pacte,Le Pacte,Chaz Productions','Khédidja travaille pour une famille parisienne aisée qui lui propose de s\'occuper des enfants le temps d’un été en Corse. L\'opportunité pour elle de retourner avec ses filles, Jessica et Farah, sur cette île qu\'elles ont quittée quinze ans plus tôt dans des circonstances tragiques. ','Le Retour',3.3),('Hye-Young Lee|Yunhee Cho|Shin Seokho|Hae-hyo Kwon|Song Seon-mi','Hong Sang-Soo',97,4421,306540,'Drame','https://fr.web.img6.acsta.net/c_310_420/pictures/24/01/25/17/23/5945071.jpg',3.7,'21 février 2024','Capricci Films,Jeonwonsa Film Co.','Byungsoo, un réalisateur célèbre, accompagne sa fille chez une amie de longue date, propriétaire d\'un immeuble à Gangnam. La visite des lieux entraîne pour Byungsoo un voyage hors du temps où se dessinent, à chaque étage, ses amours passés et à venir. Fin portraitiste, Hong Sangsoo transforme le quotidien d\'un immeuble en puzzle des relations humaines. Un terrain de jeu qui explore les désirs, les regrets, les rêves, et bien sûr, le cinéma.','Walk Up',3),('Sylvain Katan|Myriem Akheddiou|Vincent Elbaz|César de Gouvello Grach|Olivia Côte|Daphné Crépieux|Laurent Poitrenaux|Zoé Richard|Izm|Alexandre Steiger|Sarah Touffic Othman-Schmitt|Laure Calamy|Pascal Rénéric|Suzanne de Baecque','Caroline Vignal',98,167511,307775,'Comédie dramatique|Drame|Comédie|Romance','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/20/10/50/5902027.jpg',2.9,'3 janvier 2024','France 3 Cinéma,Playtime,Diaphana Distribution,Chapka Films,La Filmerie','Un mari formidable, deux filles parfaites, un cabinet dentaire florissant : tout va bien pour Iris. Mais depuis quand n’a-t-elle pas fait l’amour ? Peut-être est-il temps de prendre un amant. S\'inscrivant sur une banale appli de rencontre, Iris ouvre la boite de Pandore. Les hommes vont tomber… Comme s’il en pleuvait !','Iris et les hommes',2.4),('Didier Daijardin|Albert Narayaninsamy|Yann Ichon Bella Ola|Céline Loco|Jacqueline Baltus|Nathaly Coualy|Francky Briny|Franck Monier|Ronald Pierre|Gaspar Noé|Elise Cresson|Michel Houellebecq|Blanche Gardin|Rio M