er un souhait. Seulement Kokoro n’est pas seule : six autres adolescents ont le même objectif qu’elle.','Le Château Solitaire dans le Miroir',3.8),('Jochen Hägele|Yumi Narita|David Mora|Hubert Roulleau|Sébastien Chassagne|Victoria Monfort|Aaliyah Lexilus|Claudia Tagbo|Michèle Laroque|Adeline Toniutti','Stéphane Ben Lahcene',89,116784,311631,'Comédie','https://fr.web.img2.acsta.net/c_310_420/pictures/23/12/14/16/16/5709345.jpg',3.2,'20 mars 2024','TF1 Films Production,UGC Distribution,Les films du 24,Newen','Après une soirée pleine d’excès, Bénédicte, célèbre chanteuse d’opéra, voit sa carrière s’écrouler. Fatou, passionnée de karaoké, est la seule à lui tendre la main. Elle a une idée derrière la tête : convaincre Bénédicte de participer au grand concours national de karaoké. La parfaite maîtrise vocale de l’une et la ténacité de l’autre pourraient bien faire des étincelles et les amener très loin.','Karaoké',3.3),('Abdallah Moundy|Emmanuel Bonami|Xing Xing Cheng|Finnegan Oldfield|Marie-Philomène Nga|Jérôme Niel|Théo Christine|Malik Amraoui|Mahamadou Sangaré|Sofia Lesaffre','Sébastien Vaniček',106,69531,311895,'Epouvante-horreur','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/30/11/13/5779947.jpg',3.6,'27 décembre 2023','My Box Films,WTFilms,Charades,Tandem,Tandem','Face à une invasion d\'araignées, les habitants d\'un immeuble vont devoir survivre.','Vermines',3.8),('0','Tian Xiaopeng',112,79728,313044,'Aventure|Animation|Fantastique','https://fr.web.img5.acsta.net/c_310_420/pictures/23/12/01/14/15/3412210.jpg',3.2,'21 février 2024','KMBO,Games of Com,October Media','Shenxiu, une fillette de 10 ans, est aspirée dans les profondeurs marines durant une croisière familiale. Elle découvre l’univers fantastique des abysses, un monde inconnu peuplé d’incroyables créatures. Dans ce lieu mystérieux émerge le Restaurant des abysses, dirigé par l’emblématique Capitaine Nanhe. Poursuivis par le Fantôme Rouge, leur route sera semée d’épreuves et de nombreux secrets. Leur odyssée sous-marine ne fait que commencer.','Le Royaume des abysses',4),('Ken Uehara|Michiko Ai|Keizô Kawasaki|Eijirô Tôno|Fujiko Yamamoto|Hikaru Hoshi|Eitarô Ozawa','Kôzaburô Yoshimura',104,1237,313204,'Drame|Romance','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/21/11/45/5518693.jpg',3.4,'6 mars 2024','Carlotta Films','Kiwa Funaki travaille à la teinturerie de son père à Kyoto. Cette femme indépendante et talentueuse y conçoit des tissus et accessoires qu’elle commercialise elle-même jusqu’à Tokyo. À bientôt trente ans, son entourage aimerait la voir mariée mais Kiwa trouve son épanouissement dans son art. Un jour, elle fait la rencontre de M. Takemura, professeur à l’université d’Osaka. Ce client singulier et érudit, au demeurant marié et père de famille, trouble la jeune femme...','Rivière de nuit',0),('Kamel Abdelli|Etienne Parc|Clémence Schreiber|Vincent Lindon|Florent Cheippe|Karole Rocher|Jean-Charles Canu|Gina Jimenez|Alexandra Holzhammer|Myriam Djeljeli|Pascal Vannson|Sandie Masson|Jacky Latulipe|Emmanuel Rausenberger|Mélanie Leclef|Nina Boukhrief','Nicolas Boukhrief',102,55026,313397,'Drame','https://fr.web.img5.acsta.net/c_310_420/pictures/24/02/05/11/47/5329264.jpg',3,'6 mars 2024','Goodfellas,Eskwad,Le Pacte','Jacques Romand est un professeur qui a perdu sa vocation. Témoin d’une agression dans une épicerie de quartier, il permet l’arrestation de l’un des voleurs : Victor, 14 ans. Mais en découvrant le sort de ce gamin déscolarisé que l’on force à voler pour survivre, Jacques va tout mettre en œuvre pour venir en aide à ce jeune parti sur de si mauvais rails. Quitte à affronter ceux qui l’exploitent. En luttant contre les réticences mêmes de Victor pour tenter de lui offrir un avenir meilleur, Jacques va changer son propre destin...','Comme un fils',3.3),('Jarry|Louna Espinosa|Noé Chabbat|Léonard Signoret|Adèle Soussan|Chantal Ladesou|Firmine Richard|Liliane Rovère|Axel Gallois|Amanda Lear|Daniel Prévost|Stéphane Debac|Sophie Vannier|Brahim Bouhlel|Zoé Diowo-Ceccaldi|Quentin Morlaas|Michel Jonasz|Jean-Luc Bideau|Anne Marivin|Marthe Villalonga|Kev Adams|Enrico Macias|Nicolas Buchoux|Jean Reno|Gérard Depardieu','Claude Zidi Jr.',102,526067,313914,'Comédie','https://fr.web.img3.acsta.net/c_310_420/pictures/23/11/28/14/21/0273666.jpg',2.6,'14 février 2024','TF1 Films Production,My Family,Apollo Films,Apollo Films,The Man,Ginger & Fed','Quand le foyer Lino Vartan - qui accueille jeunes orphelins et seniors- doit fermer pour raisons sanitaires, Milann n’a pas d’autre choix que de répondre à l’invitation d’une maison de retraite dans le Sud qui les accueille pour l’été. Tous embarquent dans le bus d’Alban. Enfants et anciens découvrent alors le Bel Azur Club, une villa idyllique au bord de la mer : le rêve ! Une aubaine pour ces gamins orphelins qui n’ont jamais eu de vacances... Mais le paradis tourne à l’enfer car anciens et nouveaux pensionnaires du 3e âge se détestent ! La guerre des seniors est déclarée !','Maison de retraite 2',3),('Davaasamba Sharav|Batzorig Sukhbaatar','Zoljargal Purevdash',98,26073,315227,'Drame','https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/30/10/45/5693448.jpg',3.6,'10 janvier 2024','Eurozoom,Urban Factory,Amygdala Films','Ulzii, un adolescent d’un quartier défavorisé d’Oulan-Bator, est déterminé à gagner un concours de sciences pour obtenir une bourse d’étude. Sa mère, illettrée, trouve un emploi à la campagne les abandonnant lui, son frère et sa sœur, en dépit de la dureté de l’hiver. Déchiré entre la nécessité de s’occuper de sa fratrie et sa volonté d’étudier pour le concours, Ulzii n’a pas le choix : il doit accepter de se mettre en danger pour subvenir aux besoins de sa famille.','Si seulement je pouvais hiberner',3.9),('Fabrice Eboué|Guy Lecluyse|Victor Meutelet|Vincent Pasdermadjian|Anouk Grinberg|Yasin Houicha|Pauline Clément|Sami Outalbali|Louise Coldefy|Mathieu Lourdel|Ayumi Roux|Sam Karmann|Esteban Hernandez-Sanchez|Illyès Salah|Inès Angelina Mnafek-Amandio|Audrey Lamy','Maxime Govare',103,136628,316138,'Comédie','https://fr.web.img6.acsta.net/c_310_420/pictures/24/01/17/11/50/4118109.jpg',3.6,'13 mars 2024','Warner Bros. France,Charades','1 chance sur 19 millions. Plus de probabilité d’être frappé par une météorite que de gagner au loto. Pour nos heureux gagnants, le rêve va rapidement se transformer en cauchemar, et leur vie va voler en éclat dans un spectaculaire feu d’artifices de comédie noire et de sensations fortes.','Heureux gagnants',3.5),('Nicolas Sartous|Fauve Hautot|Moussa Maaskri|Maxime Gasteuil|Redouane Bougheraba|Issa Doumbia|Fatoumata Kaba','Ali Boughéraba',102,344268,316875,'Comédie','https://fr.web.img6.acsta.net/c_310_420/pictures/23/10/24/15/24/3478223.jpg',2,'27 décembre 2023','StudioCanal,Kallouche Cinéma,Apollo Films,Apollo Films,C8 Films,Mandarin & Compagnie,Darka Movies','Les Segpa se retrouvent pour une nouvelle année scolaire riche en aventures, propulsés directement en Terminale. Deux challenges majeurs les attendent : la réussite de leur bac et leur participation soudaine aux Olympiades d’hiver inter-lycées.','Les SEGPA au ski',1.2),('0','Neil Boyle',84,72554,316881,'Aventure|Animation','https://fr.web.img3.acsta.net/c_310_420/pictures/23/10/06/09/10/3585927.jpg',3.7,'7 février 2024','Mélusine Productions,Le Pacte,Le Pacte,Studio 352,Bankside Films,Lupus Films,Jigsaw Films,Bumpybox','L’incroyable histoire de Michael, 11 ans, parti faire un tour du monde à la voile avec ses parents, avant qu’une terrible tempête ne le propulse par-dessus bord avec sa chienne Stella. Échoués sur une île déserte, comment survivre ? Un mystérieux inconnu vient alors à leur secours en leur offrant à boire et à manger. C’est Kensuké, un ancien soldat japonais vivant seul sur l’île avec ses amis les orangs-outans depuis la guerre. Il ouvre à Michael les portes de son royaume et lorsque des trafiquants de singes tentent d’envahir l’île, c’est ensemble qu’ils uniront leurs forces pour sauver ce paradis...','Le Royaume de Kensuke',4.1),('0','Karla Nor Holmbäck',75,10886,317077,'Famille|Animation','https://fr.web.img6.acsta.net/c_310_420/pictures/23/12/21/11/36/4465693.jpg',3.2,'14 février 2024','Gebeka Films','Rose est une petite fée qui a toujours vécu seule dans son rosier. Elle rêve passionnément d’avoir un ou une ami(e), mais a trop peur de l’inconnu pour s’éloigner de son repaire. Un jour, Satin, un papillon à la recherche d’aventures, croise le chemin de Rose et elles deviennent immédiatement amies, malgré leurs différences. Satin veut partir à la découverte du monde, et quant à elle, Rose préfère rester tranquille dans son rosier. Mais, lorsque sa nouvelle amie est kidnappée par une méchante Troll de Pierre, Rose doit surmonter ses peurs et se lancer dans un dangereux voyage jusqu’aux Montagnes noires pour sauver Satin.','Rose, petite fée des fleurs',2.6),('Ozuno Nakamura|Kentarô Furuyama|Kenji Mizuhashi|Minami Hamabe|Ryûnosuke Kamiki|Shota Taniguchi|Kisuke Iida|Munetaka Aoki|Jun Saito|Yûya Endô|Yûki Yamada|Kuranosuke Sasaki|Michael Arias|Sakura Andô|Sentaro Kusakabe|Hidetaka Yoshioka','Takashi Yamazaki',124,263,318060,'Action|Aventure|Science Fiction','https://fr.web.img4.acsta.net/c_310_420/pictures/24/01/03/11/55/3350041.jpg',3.9,'7 décembre 2023','Toho,Piece of Magic Entertainment France,Piece of Magic Entertainment France','Le Japon se remet à grand peine de la Seconde Guerre mondiale qu’un péril gigantesque émerge au large de Tokyo. Koichi, un kamikaze déserteur traumatisé par sa première confrontation avec Godzilla, voit là l’occasion de racheter sa conduite pendant la guerre.','Godzilla Minus One',4.2);
